(1, 'GHOST IN THE SHELL', 'Motoko Kusanagi (Scarlett Johansson) adalah seorang agen cyborg yang hidup di era tahun 2029 dimana robot-robot dengan kecerdasan buatan hidup berdampingan dengan manusia. \r\n\r\nKusanagi dan sejumlah anggota tim keamanan, Public Security Section 9 memiliki kewajiban untuk menghentikan kejahatan yang dilakukan oleh hacker terkenal, the Puppet Master dan mengantisipasi pergerakan dari penjahat misterius yang ingin menghancurkan perkembangan teknologi dari Hanka Robotic.', 'Action, Drama, Sci-fi', 2017, '2017-03-29', 120, 'Rupert Sanders', 'William Wheeler', 'Scarlett Johansson, Michael Pitt, Juliette Binoche', 'http://www.21cineplex.com/data/gallery/pictures/148912889080786_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/G4VmJcZR0Yg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0113568', 8, 0, 11, 9, NULL, 0, 2),
(2, 'MISS SLOANE', 'Elizabeth Sloane (Jessica Chastain) adalah pelobi politik yang handal dan terkenal di Washington D.C. Strategi politiknya selalu berhasil mengalahkan lawan-lawannya.\r\n\r\nNamun sebuah kasus akan membawanya pada suatu dilema. Ia berada di posisi sulit saat sebuah Undang-undang kepemilikan senjata api sedang diuji. Elizabeth menjadi salah satu pelobi di pihak yang tengah berseteru akan Undang-undang tersebut.', 'Drama, Thriller', 2016, '2016-12-09', 132, 'John Madden', 'Jonathan Perera', 'Jessica Chastain, Gugu Mbatha-Raw, Michael Stuhlbarg, John Lithgow', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTAyODY4Njc4MjBeQTJeQWpwZ15BbWU4MDI0NTIzMDAy._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/AMUkfmUu44k\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4540710', 7.2, 63, 19, 10, NULL, 0, 2),
(3, 'THE BOSS BABY', 'Berkisah tentang kehidupan seorang bayi yang tampak berbeda dari bayi pada umumnya. Ia nakal, keras kepala, selalu mengenakan jas, membawa koper dan kopi adalah minuman kesukaanya. \r\n\r\nDi balik penampilannya, Boss Baby adalah utusan dari Baby Corp. Perusahaan yang bertugas untuk menyelidiki dan menghentikan bisnis dari Puppy Co., sebuah organisasi yang berniat untuk melemahkan bisnis makanan bayi demi keuntungan bisnis makanan hewan.', 'Animation, Comedy, Family', 2017, '2017-03-31', 0, 'Tom McGrath', 'Marla Frazee (book), Michael McCullers (screenplay)', 'Miles Christopher Bakshi, Alec Baldwin, Eric Bell Jr., Steve Buscemi', 'http://www.21cineplex.com/data/gallery/pictures/148939461451821_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/tquIfapGVqs\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3874544', 6.5, 50, 39, 37, NULL, 0, 2),
(4, 'FAST & FURIOUS 8', 'Dalam seri ke delapan dari franchise Fast and Furious, Dom (Vin Diesel) akan mengkhianati teman-temannya dan bekerjasama dengan teroris bernama Chiper (Charlize Theron).\r\n\r\nTak lama setelah itu, tim yang tersisa direkrut oleh pasukan agen rahasia pemerintah pimpinan Frank Petty (Kurt Russel). Tugas mereka adalah menghentikan aksi teror yang direncanakan oleh Dom dan Chiper.', 'Action, Crime, Thriller', 2017, '2017-05-24', 130, 'F. Gary Gray ', 'Chris Morgan, Gary Scott Thompson (characters)', 'Vin Diesel, Dwayne Johnson, Jason Statham', 'http://www.21cineplex.com/data/gallery/pictures/148905122668489_452x647.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/19uRZ0vVVbA\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1905041', 7.1, 61, 62, 113, 'ff8, fast8, furious 8, fast 8, furious 8, fast furious 8, last ride', 0, 2),
(5, 'LIFE', 'Enam orang astronot dipilih untuk ditempatkan di stasiun luar angkasa internasional. Pada awalnya mereka bersemangat ketika sebuah robot penjelajah menemukan menemukan bukti pertama yang menandakan kehidupan di Mars. Para astronot yang terbuai oleh kesuksesan mereka tidak menyadari jika kehidupan yang mereka temukan merupakan ancaman bagi umat manusia.', 'Horror, Sci-fi, Thriller', 2017, '2017-02-05', 108, 'Daniel Espinosa', 'Robert Ramsey, Matthew Stone', 'Jake Gyllenhaal, Rebecca Ferguson, Ryan Reynolds', 'http://www.21cineplex.com/data/gallery/pictures/148879301615406_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/cuA-xqBw4jE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0123964', 6.7, 63, 0, 0, NULL, 0, 2),
(6, 'GOLD', 'Kenny Wells (Matthew McConaughey) adalah seorang pebisnis yang mengalami kesulitan finansial. Kenny berusaha merubah peruntungannya dengan mencari tambang emas di hutan yang belum di petakan di wilayah Kalimantan, Indonesia.\r\n\r\nBersama temannya Michael Acosta (Edgar Ramirez) ahli geologi, Kenny menelusuri belantara hutan demi impiannya.', 'Adventure, Drama, Thriller', 2017, '2017-01-27', 120, 'Stephen Gaghan', 'Patrick Massett, John Zinman', 'Matthew McConaughey, Edgar Ramrez, Bryce Dallas Howard, Corey Stoll', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjEwNzMzMDI4Nl5BMl5BanBnXkFtZTgwMTM2ODkwMTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/IhYROWOayLw\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1800302', 6.6, 49, 0, 0, NULL, 0, 2),
(7, 'PERFECT DREAM', 'Bagi DIBYO keberhasilan diukur dari seberapa besar ia mampu memenuhi ambisi hidupnya. Dari kehidupan jalanan menjalankan bisnis gelap, Dibyo berhasil menikahi Lisa, putri Marcel Himawan, seorang pengusaha besar di kalangan elite Surabaya. Dibyo bahkan berhasil mengembalikan kejayaan bisnis Marcel. \r\n\r\nHarta berlimpah tak membuat Dibyo puas. Ambisi Dibyo adalah menguasai wilayah lawan bisnisnya, Hartono si mafia nomor satu. Pertikaian antar-geng pun tak terelakkan.\r\n\r\nAmbisi Dibyo makin meluap setelah mengenal Rina, pemilik galeri foto yang mampu memberi kehangatan cinta seorang ibu yang tak pernah Dibyo dapatkan selama ini. \r\n\r\nLisa harus memilih, mengikuti ambisi suaminya atau berjuang mempertahankan keutuhan keluarga yang ia cintai!', 'Drama', 2017, '2017-03-20', 0, 'Hestu Saputra', 'Sinung Winahyo, Hestu Saputra', 'Rara Nawangsih, Tissa Biani Azzahra, Wulan Guritno, Olga Lydia', 'http://www.21cineplex.com/data/gallery/pictures/148834342534292_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/Ocd9naaBprI\" frameborder=\"0\" allowfullscreen></iframe>', 'tt6522380', 0, 0, 0, 1, NULL, 0, 2),
(9, 'BEAUTY AND THE BEAST', 'Ketika Belle (Emma Watson) pergi untuk mencari ayahnya, Maurice (Kevin Kline), ia menemukan jika ayahnya disekap di dalam sebuah kastil tua oleh The Beast (Dan Stevens). Belle kemudian bertukar tempat sebagai tahanan demi membebaskan ayahnya. \r\n \r\nGadis itu terkejut ketika menyadari jika benda-benda di dalam kastil itu hidup dan dapat berbicara. Benda-benda tersebut memberitahu jika watak Beast tidaklah seburuk penampilannya. Ketika ia mulai dekat dengan Beast, para penduduk kota telah melakukan persiapan untuk menolong sang gadis.', 'Animation, Family, Fantasy', 2017, '2017-03-23', 129, 'Bill Condon ', 'Evan Spiliotopoulos, Stephen Chbosky', 'Emma Watson, Dan Stevens, Luke Evans, Josh Gad', 'http://www.21cineplex.com/data/gallery/pictures/148816706164595_452x647.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/e3Nl_TCQXuw\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0101414', 8, 95, 8, 17, NULL, 0, 2),
(10, 'MOON CAKE STORY', 'David adalah seorang pengusaha muda yang menjadi taipan dan berada pada puncak keberhasilan bisnisnya. Di sisi lain, Asih adalah seorang wanita yang hidup di tengah kampung kumuh Jakarta dengan bekerja serabutan dari joki 3 in 1 dan mencuci dari toko laundry. Asih harus menjadi tulang punggung bagi anak dan adiknya di tengah beragam persoalan Jakarta yang penuh kisah-kisah kemanusiaan. Asih menjadi perempuan yang selalu bertanya: mampukah mengubah kemiskinan, namun juga mempertahankan prinsip hidup? \r\n\r\nSementara, David lalu bertanya berulang kali pada dirinya: Kenapa penyakit terjadi pada dirinya, justru di tengah puncak suksesnya? Dan kenapa dirinya seperti didorong ke ingatan masa lampau ketika dirinya hidup miskin bersama ibunya? \r\n\r\nKisah film ini dimulai ketika David harus melewati jalan 3 in 1 agar cepat sampai ke kantornya dengan supirnya, David tanpa sengaja tertarik pada sosok joki bernama Asih yang menggandeng anaknya, Bimo (12 tahun). \r\n\r\nKisah pun berlanjut. David menemui kembali Asih untuk memberi uang bayaran joki yang belum terbayar, namun yang terjadi kemudian, pertemuan demi pertemuan tanpa sengaja membawa David mengenal Asih, Bimo, dan Sekar, adik Asih, serta kehidupan lingkungan kampung kumuh tempat tinggal Asih di belakang jalan menuju 3 in 1.\r\n\r\nDavid yang dalam proses kehilangan ingatan, justru semakin terbawa memori masa kecilnya, terlebih David menemukan sosok Asih sebagai sosok ibunya yang bekerja keras untuk menghidupi David dan Kakak nya Aline kesedihan dan kegembiraan selalu meliputi kehidupan keluarga David .. dalam menjalani hidup di kota besar Ibu David adalah, sosok ibu tunggal yang mampu hidup di tengah kemiskinan dan merawat David dengan prinsip-prinsip hidup tentang manusia dan kerja.\r\n\r\nSementara, Asih lewat David menemukan keindahan mengubah dan membangun hidupnya dan keluarganya tanpa kehilangan prinsip hidup. Sebuah nilai hidup yang perlu ditumbuhkan di kota-kota besar, ketika kemanusiaan terkubur oleh kekerasan kompetisi hidup kota besar Film yang memberikan arti hidup dalam menjalani keras nya Ibukota.', 'Animation, Family, Fantasy', 2016, '2016-11-22', 84, 'Garin Nugroho', 'Garin Nugroho', 'Bunga Citra Lestari, Morgan Oey, Dominique Diyose, Melati Zein', 'https://www.bioskoptoday.com/wp-content/uploads/2016/12/poster-mooncake-story.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/KjqRVPp07NU\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0101414', 8, 95, 0, 0, '', 0, 2),
(11, 'DEAR NATHAN', 'Tidak ada hal yang sangat diinginkan SALMA di sekolah barunya selain focus pada belajar dan menunjukkan prestasinya. Sebagai murid pindahan di SMA Garuda, Salma berusaha selektif memilih teman. Sayangnya pagi itu Salma terlambat datang dan seorang siswa yang tidak kenal menolongnya menyelinap kesekolah dan menyelamatkannya dari hukuman terlambat upacara bendera. Belakangan Salma tahu bahwa siswa penolong itu bernama NATHAN, murid paling berandal seantero sekolah yang hobi tawuran.\r\n\r\nSebagai murid baik-baik, tentu Salma berusaha menjauhi orang macam Nathan. Namun, masalah datang ketika Nathan dengan terang-terangan mengejar cinta Salma dan membuat heboh satu sekolah. Berbagai cara digunakan Salma untuk menghindar, tapi sepertinya kesempatan-kesempatan tak terduga justru mengantarnya semakin dekat dengan Nathan.\r\n\r\nSaat Salma memahami titik rapuh masa lalu Nathan, dia pun bersimpati dan perlahan jatuh cinta. Saat cinta Salma tumbuh, dia ingin merubah Nathan menjadi Nathan yang baru. Di saat Nathan serius membuka diri untuk diubah oleh Salma, kekasih masa lalu Nathan bernama SELI, datang untuk meminta cinta Nathan kembali.\r\n\r\nAkankah Salma mempertahankan Nathan sebagai cinta pertama dalam hidupnya?', 'Drama', 2017, '2017-03-23', 84, 'Indra Gunawan', 'Bagus Bramanti, Gea Rexy', 'Jefri Nichole, Amanda Rawles, Rayn Wijaya, Diandra Agatha', 'https://upload.wikimedia.org/wikipedia/id/9/9e/Dear_Nathan.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/8GIQsLKMBkk\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0101414', 8, 95, 20, 21, '', 0, 2),
(12, 'BARACAS', 'Bandung geger, oleh adanya pemuda yang terpaksa meninggalkan keluarganya untuk bergabung dengan BARACAS. Baracas adalah merupakan Kelompok Independen yang dibentuk oleh seseorang bernama AGUS untuk menjadi tempat bergabungnya kaum lelaki yang dikecewakan oleh wanita. Mereka meng-klaim dirinya sebagai kaum lelaki yang merana karena adanya peristiwa pengkhianatan, penolakan, dan lain-lain sebagainya. Mereka menghimpun kekuatan dan menyatukan perasaan untuk bersama-sama dengan sengaja melakukan upaya membenci wanita di seluruh dunia dan pada semua unsur yang bersangkutan dengan wanita. Mereka menganggap dirinya sebagai korban wanita. Apa yang sudah dilakukan oleh wanita kepada mereka dinggapnya sebagai kekejaman yang tidak bisa dimaafkan dan menjatuhkan harga diri laki-laki di seluruh dunia. AGUS, pendiri dan sekaligus ketua Baracas adalah mantan pacarnya SARAH, Agus kecewa kepada Sarah karena secara tiba-tiba Sarah memutuskan hubungan mereka. Alhasil Agus geram, Agus marah, tidak cuma ke Sarah tetapi kepada seluruh wanita yang ada di muka bumi ini.\r\n\r\nGerakan-gerakan perlawanan terhadap BARACAS dengan berbagai macam upaya. Mereka merunding pihak polisi dan pemerintahan kota Bandung, sengaja membiarkan Baracas untuk berkembang besar. Itulah sebabnya mereka demo. Itulah sebabnya mereka menuntut polisi untuk menindak anggota Baracas. Bahkan Baracas mendapatkan teror berupa serangan fisik dari orang-orang tertentu untuk merusak markas Baracas dengan menggunakan kekerasan. Perlawanan lain dilakukan juga oleh para wanita yang tak lain adalah para mantan anggota Baracas. Mereka bergabung untuk membuat kekuatan dengan tujuan meluluhkan perasaann anggota Baracas dengan melakukan berbagai cara ampuh untuk mengubah cara berpikir mereka. Mereka dibantu oleh CEU POPONG yang selalu memberi nasihat dan masukan apa-apa saja yang dilakukan oleh para mantan itu. Akankah para mantan itu berhasil meluluhkan perasaan mereka?', 'Comedy', 2017, '2017-03-23', 120, 'Pidi Baiq', 'Pidi Baiq', 'Ringgo Agus Rahman, Ajun Perwira, Stella Cornelia', 'http://www.21cineplex.com/data/gallery/pictures/14873264526232_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/0469OXCxnPQ\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0101414', 8, 95, 3, 1, NULL, 0, 2),
(13, 'POWER RANGERS', 'Film yang menjadi seri pertama Power Rangers di abad ke 21 ini akan menampilkan beberapa tokoh utama dari seri Mighty Morphin Power Rangers yang akan diperankan oleh aktor terbaru.\\n\\nBerkisah mengenai lima remaja yang dipersatukan oleh sebuah insiden yang', 'Action, Adventure, Sci-fi', 2017, '2017-02-23', 120, 'Dean Israelite', 'John Gatins, Matt Sazama, Burk Sharpless, Zack Stentz', 'Elizabeth Banks, Rj Cyler, Naomi Scott, Becky G.', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTU1MTkxNzc5NF5BMl5BanBnXkFtZTgwOTM2Mzk3MTI@._V1_UY1200_CR74,0,630,1200_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/5kIe6UZHSXw\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4475970', 7.8, 0, 19, 11, '', 0, 2),
(15, 'BID\'AH CINTA', 'Hubungan asmara antara Khalida dan Kamal tak direstui oleh dua keluarga yang saling berbeda dan bermusuhan, keluarga mereka mempunyai pemahaman tentang Islam yang berbeda satu sama lain. Islam puritan & Islam tradisional. Persoalan perbedaan pandangan agama ini menyeret hubungan asmara mereka ke dalam pusaran konflik. Khalida adalah anak H. Rohili, seorang yang sangat akrab dengan para pemuda di kampung itu. Di sisi lain, Kamal adalah anak lelaki H. Jamat, seorang haji kaya yang cukup disegani dan menjadi pendukung utama penyebaran Islam puritan di kampung yang dimotori kemenakannya bernama Ustadz Jaiz.\r\n\r\nPerbenturan antara H. Rohili dan H. Jamat pada akhirnya juga membenturkan hubungan Khalida dengan Kamal. Khalida yang dibesarkan dalam ajaran Islam tradisional merasa terganggu dengan perkembangan ini. Sebaliknya, Kamal yang banyak mendapat pengaruh dari ajaran Islam puritan H. Jamat dan berkepentingan dengan pekerjaannya di Yayasan pendidikan yang dipimpin oleh Ustadz Jaiz, merasa bingung dan tertekan dalam posisinya yang sulit. \r\n\r\nDi tengah lingkungan yang tak mungkin diseragamkan dan di mana perbedaaan merupakan suatu keniscayaan, bagaimanakah kelanjutan kisah cinta Khalida dan Kamal? Apakah cinta dapat menghapus segala kebencian yang ada?', 'Drama', 2017, '2017-03-16', 128, 'Casper Van Dien', 'Nurman Hakim', 'Cassi Thomson, Samantha Cope, Casper Van Dien, Randy Wayne', 'https://www.bioskoptoday.com/wp-content/uploads/2017/01/poster-bidah-cinta.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/_o1fwxzZIuE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5084204', 5.7, 0, 0, 1, '', 0, 2),
(16, 'THE SPACE BETWEEN US', 'Sekelompok astronot diutus untuk pergi ke dalam misi penelitian di Mars. Ketika mendarat, salah seorang astronot menemukan jika ia tengah mengandung. Tidak lama kemudian astronot itu meninggal setelah ia melahirkan seorang bayi lelaki. \r\n \r\nEnam belas tahun kemudian, putra dari sang astronot, Gardner Elliot telah tumbuh menjadi seorang remaja yang menghabiskan hidupnya di planet Mars bersama para astronot. Gardner memiliki keinginan untuk bertemu dengan ayah kandungnya di bumi. Sementara itu ia juga menjalani persahabatan dengan Tulsa (Britt Robertson), seorang gadis yang tinggal di Colorado. \r\n \r\nKetika Gardner dan astronot lainnya kembali ke bumi, ia menyadari jika organ tubuhnya tidak terbiasa dengan atmosfir bumi. Ketika dirawat di rumah sakit, Gardner melarikan diri untuk mencari Tulsa. ', 'Adventure, Drama, Romance', 2017, '2017-02-03', 120, 'Peter Chelsom', 'Allan Loeb (screenplay), Stewart Schill (story by), Richard Barton Lewis (story by), Allan Loeb (story by)', 'Gary Oldman, Janet Montgomery, Trey Tucker, Scott Takeda', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjYzODU1OTkwN15BMl5BanBnXkFtZTgwMDA3MTMwMDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/x73-573aWfs\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3922818', 6.3, 33, 14, 31, NULL, 0, 2),
(18, 'TRINITY, THE NEKAD TRAVELER', 'Awalnya TRINITY (Maudy Ayunda) adalah seorang Mbak-mbak kantoran yang hobi traveling sejak kecil. Namun hobinya ini sering terbentur dengan duit pas-pasan dan jatah cuti di kantor. Akibatnya Trinity sering diomeli BOSS (Ayu Dewi). Trinity memiliki sahabat yang punya hobi sama, yakni YASMIN (Rachel Amanda) dan NINA (Anggika Bolsterli), ditambah dengan sepupu Trinity, EZRA (Babe Cabita). Trinity selalu menuliskan pengalamannya dalam sebuah blog berjudul naked-traveler.com.\r\n\r\nDi rumah, BAPAK (Farhan) dan MAMAH (Cut Mini) selalu menanyakan kapan Trinity serius memikirkan jodoh. Tapi Trinity selalu menjawab : nanti kalau semua bucket list sudah terpenuhi. Bucket list adalah daftar hal-hal yang harus Trinity lakukan sebelum tua, kebanyakan sih isinya (lagi-lagi) tentang jalan-jalan. Bapak langsung pusing mendengarnya. Trinity mengalami dilema antara fokus ke pekerjaannya sekarang atau mengejar passion dia yang sebenarnya, hingga kisah cintanya dengan PAUL (Hamish Daud) seorang fotografer tampan yang juga hobi traveling.', 'Drama', 2017, '2017-03-30', 103, 'Rizal Mantovani', 'Rahabi Mandra', 'Maudy Ayunda, Hamish Daud, Babe Cabiita', 'http://www.21cineplex.com/data/gallery/pictures/14860059712454_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/TNOALGw6vqM\" frameborder=\"0\" allowfullscreen></iframe>', 'tt6496236', 0, 0, 0, 0, NULL, 0, 2),
(19, 'SHUT IN', 'Mary (Naomi Watts) yang berprofesi sebagai psikolog anak mencoba untuk membangun kehidupnya kembali setelah ia kehilangan suaminya dalam sebuah kecelakaan mobil. Akan tetapi, meskipun putranya yang bernama Stephen(Charlie Heaton) lolos dari maut, kecelakaan tersebut telah membuatnya jatuh ke dalam koma.\r\n \r\nMary yang membuka praktek di rumah mendapatkan seorang pasien baru bernama Tom (Jacob Tremblay), seorang anak yang ibunya baru saja meninggal. Saat mendengar jika Tom akan dibawa ke Boston, Mary memutuskan untuk merawat Tom dirumahnya sendiri. Tidak lama setelah itu, Tom melarikan diri di tengah badai salju dan dinyatakan meninggal oleh yang berwajib, meskipun tubuhnya tidak pernah ditemukan.\r\n \r\nMary yang merasa bersalah atas kematian Tom tiba-tiba mendengar suara dan melihat bayangan anak itu di dalam rumahnya. Kekuatan mental sang psikolog mulai diuji ketika beberapa kejadian misterius mulai bermunculan pada saat badai salju membuatnya terjebak di rumahnya sendiri.', 'Drama, Thriller', 2016, '2016-11-11', 91, 'Farren Blackburn', 'Christina Hodson', 'Naomi Watts, Oliver Platt, Charlie Heaton, Jacob Tremblay', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjM3MTAyMTE2MV5BMl5BanBnXkFtZTgwMzY5MzM0MDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/G7czL2a5R3c\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2582500', 4.4, 22, 0, 0, NULL, 0, 2),
(24, 'BADRINATH KI DULHANIA', 'Badrinath Bansal (Varun Dhawan) dan Vaidehi Trivedi (Alia Bhatt) adalah sepasang muda-mudi yang berasal dari kota kecil. Keduanya bertemu dan saling jatuh hati.\r\n\r\nKisah keduanya rumit saat terjadi perbedaan prinsip. Namun walaupun demikian keduanya tetap saling menaruh hati. Bagaimana akhir kisahnya? Saksikan Badrinath Ki Dulhania di bioskop.', 'Comedy, Drama, Romance', 2017, '2017-03-10', 139, 'Shashank Khaitan', 'Shashank Khaitan', 'Varun Dhawan, Alia Bhatt, Gauhar Khan, Girish Karnad', 'http://static.koimoi.com/wp-content/new-galleries/2017/01/badrinaath-ki-dulhania-poster-1.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/ztX-iGlZ_Ug\" frameborder=\"0\" allowfullscreen></iframe>', 'tt6277440', 0, 0, 0, 0, '', 0, 2),
(25, 'DANGAL', 'Mahavir Singh Phogat (Aamir Khan) yang pernah menjuarai sebuah turnamen gulat memiliki mimpi untuk memenangkan medali emas untuk kompetisi gulat dunia. Namun, masalah finansial memaksanya pensiun dari karirnya sebagai pegulat profesional. Pada saat itu Phogat mengharapkan jika kelak anak lelakinya dapat meneruskan cita-citanya. Akan tetapi Phogat merasa putus asa setelah istrinya melahirkan empat anak perempuan. Beberapa tahun kemudian ia melihat kedua anak perempuannya, Geeta dan Babita mengalahkan dua orang anak laki-laki. Phogat menyadari bakat mereka dan mulai melatih anak-anaknya menjadi pegulat profesional.', 'Action, Biography, Drama', 2016, '2016-12-21', 161, 'Nitesh Tiwari', 'Piyush Gupta, Shreyas Jain, Nikhil Mehrotra, Nitesh Tiwari', 'Aamir Khan, Sakshi Tanwar, Fatima Sana Shaikh, Sanya Malhotra', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ4MzQzMzM2Nl5BMl5BanBnXkFtZTgwMTQ1NzU3MDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/x_7YlGv9u1g\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5074352', 9, 0, 3, 5, NULL, 0, 2),
(26, 'NOBITA AND THE BIRTH OF JAPAN', 'DORAEMON THE MOVIE: NOBITA AND THE BIRTH OF JAPAN - Dalam film Doraemon terbaru, Nobita dan teman-teman menempuh perjalanan waktu untuk kembali ke Jepang di masa prasejarah dimana mereka akan membangun sebuah kota impian. Di waktu yang sama, mereka bertemu dengan seorang bocah bernama Kukuru yang berada dalam masalah karena sukunya ditindas oleh dukun misterius bernama Gigazombie. Mampukah Nobita dan kawan-kawan menyelamatkan Kukuru beserta anggota sukunya yang tertindas?', 'Animation', 2016, '2016-01-26', 103, 'Shinnosuke Yakuwa', 'Shinnosuke Yakuwa, Higashi Shimzu', 'Wasabi Mizuta, Megumi Ohara, Yumi Kakazu, Subaru Kimura, Tomokazu Seki', 'http://www.metroplex.com.hk/media/224w/movie/poster/poster_1469518635.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/THU9daViUW4\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '', 7, 2),
(27, 'GALIH DAN RATNA', 'Cinta pertama. Atau cinta monyet. Atau apalah itu. Semua pasti pernah merasakannya, terutama di masa-masa remaja yang indah. Tetapi ini tidak pernah dirasakan oleh GALIH (Refal Hady), seorang siswa SMA teladan tetapi introvert yang hidup dalam bayang-bayang almarhum ayahnya dan tuntutan ibunya yang harus struggle sebagai single-mother. \r\n\r\nRATNA (Sheryl Sheinafia), seorang siswi yang baru saja pindah ke SMA tempat Galih bersekolah. Pintar dan berbakat namun ia sendiri tidak tahu passion hidupnya apa. Ia hidup tanpa tujuan, selalu mengejar hal-hal yang sangat instan. Layaknya anak millenials saat ini. \r\n\r\nDi suatu sore, di lapangan belakang sekolah, Galih dan Ratna pun bertemu. Sebuah pertemuan yang sederhana. Ratna tertarik dengan walkman yang sedang didengarkan oleh Galih. Galih membiarkan Ratna mendengarkan kaset mixtape pemberian Ayahnya. \r\n\r\nInikah yang disebut dengan cinta pertama? Yang manis, menggebu-gebu, dan juga pahit? Yang berawal dari sebuah momen sederhana di lapangan belakang sekolah? Pada akhirnya, cinta pertama inilah yang membawa Galih dan Ratna ke tahap baru dalam kehidupan mereka. Sebuah tahap pendewasaan dimana tanggung-jawab, tuntutan, dan passion saling berperang dan akhirnya berdamai. Dan cinta pertama inilah yang akan selalu menjadi sebuah kenangan yang tidak akan mereka lupakan.', 'Drama', 2017, '2017-03-09', 112, 'Lucky Kuswandi', 'Fathan Todjon, Lucky Kuswandi', 'Refal Hady, Sheryl Sheinafia, Joko Anwar, Marissa Anita', 'http://www.21cineplex.com/data/gallery/pictures/14864580058957_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/Ks0lO3zCWOQ\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 8, 4, NULL, 0, 2),
(28, 'HIDDEN FIGURES', 'Berkisah tentang tim ahli matematika wanita Afrika-Amerika yang memiliki peran penting dalam sejarah NASA.\r\n\r\nKatherine G. Johnson (Taraji P. Henson), Dorothy Vaughan (Octavia Spencer) dan Mary Jackson (Janelle Monae) adalah sosok penting dibalik keberhasilan NASA dalam proyek pertama mereka membawa manusia keluar angkasa.\r\n\r\nKetiganya merupakan ahli matematika yang membuat perhitungan terhadap pesawat yang akan digunakan pada misi pertama NASA untuk mendarat di bulan.', 'Biography, Drama, History', 2016, '2017-01-06', 126, 'Theodore Melfi', 'Allison Schroeder (screenplay), Theodore Melfi (screenplay), Margot Lee Shetterly (based on the book by)', 'Taraji P. Henson, Octavia Spencer, Janelle Mone, Kevin Costner', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjQxOTkxODUyN15BMl5BanBnXkFtZTgwNTU3NTM3OTE@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/RK8xHq6dfAo\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4846340', 7.9, 74, 19, 22, NULL, 0, 2),
(29, 'JOHN WICK: CHAPTER 2', 'Berlanjut dari film John Wick yang pertama, film ini kembali menampilkan Keanu Reeves sebagai pensiunan pembunuh bayaran, John Wick yang kembali beraksi. Kali ini John harus harus menghadapi krisis identitas yang mempertanyakan jati dirinya sebagai seorang suami yang bersedih atas kematian istrinya atau seorang pembunuh bayaran internasional tanpa belas kasihan.', 'Action, Crime, Thriller', 2017, '2017-02-10', 122, 'Chad Stahelski', 'Derek Kolstad, Derek Kolstad (based on characters created by)', 'Keanu Reeves, Riccardo Scamarcio, Ian McShane, Ruby Rose', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjE2NDkxNTY2M15BMl5BanBnXkFtZTgwMDc2NzE0MTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/XGk2EfbD_Ps\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4425200', 8.5, 75, 0, 1, NULL, 9, 2),
(31, 'LA LA LAND', 'Mia (Emma Stone), seorang perempuan yang bercita-cita tinggi untuk menjadi aktris kerap berpapasan dengan Sebastian (Ryan Gosling), musisi jazz yang bercita-cita untuk mendirikan klub jazznya sendiri. \r\n\r\nKedua orang tersebut akhirnya saling jatuh cinta dan bakhan Mia pun mulai menyukai musik Jazz. Pada suatu hari, Mia mulai meragukan kemampuannya setelah ia kerap gagal dalam mengikuti audisi film. Sebastian yang percaya dengan kemampuan akting Mia, kerap mendorong kekasihnya agar tidak menyerah. Sementara itu, Mia berpikir bahwa Sebastian terpaksa bergabung kedalam band terkenal demi mencari nafkah untuk mereka berdua. \r\n\r\nPada akhirnya, perbedaan dan perdebatan diantara keduanya pun kian melebarkan jarak diantara mereka.', 'Comedy, Drama, Musical', 2016, '2016-12-25', 128, 'Damien Chazelle', 'Damien Chazelle', 'Ryan Gosling, Emma Stone, Amie Conn, Terry Walters', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMzUzNDM2NzM2MV5BMl5BanBnXkFtZTgwNTM3NTg4OTE@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/0pdqf4P9MB8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3783958', 8.5, 93, 23, 41, NULL, 0, 2),
(32, 'LION', 'Ketika Saroo baru berusia lima tahun, ia hidup dalam kemiskinan bersama ibu dan saudara-saudaranya di sebuah kota di India. Saroo dan kakak lelakinya, Guddu sering pergi bersama untuk mengemis di sebuah stasiun kereta. Pada suatu hari, Guddu memberitahu adiknya jika ia akan naik kereta ke kota lain. Mendengar perkataan ini, Saroo memohon kakanya untuk ikut bersamanya. Guddu mengabulkan permohonan adiknya dan pada saat mereka sampai di tempat tujuan, Guddu memberitahu Saroo untuk menunggunya di sebuah peron kereta. \r\n\r\nSaat Guddu tidak kunjung kembali, Saroo mulai mencari saudaranya dengan memasuki sebuah kereta yang membawanya ke tempat yang jauh. Karena sang anak tidak dapat memberitahu polisi alamat tempat tinggalnya, ia dinyatakan sebagai anak terlantar. Bocah India tersebut pada akhirnya diadopsi oleh sepasang suami-istri yang berasal dari Australia.\r\n\r\nKetika Saroo hidup dengan keluarga barunya, ia dibesarkan sebagai anak Australia pada umumnya dan kemampuannya untuk berbicara dalam bahasa Hindi kian menghilang. Sementara itu, ibu kandungnya di India tidak berhenti untuk mencari anaknya.', 'Drama', 2016, '2017-01-06', 118, 'Garth Davis', 'Saroo Brierley (adapted from the book ', 'Sunny Pawar, Abhishek Bharate, Priyanka Bose, Khushi Solanki', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA3NjkzNjg2MF5BMl5BanBnXkFtZTgwMDkyMzgzMDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/-RNI9o06vqo\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3741834', 8, 69, 0, 0, NULL, 0, 2),
(33, 'LOGAN', 'Pada tahun 2024, Logan (Hugh Jackman) dan Profesor Charles Xavier (Patrick Stewart) harus bertahan tanpa X-Men ketika perusahaan yang dipimpin oleh Nathaniel Essex menghancurkan dunia. Keadaan menjadi semakin rumit dengan kemampuan regenerasi mutan logan yang mulai menghilang dan Xavier yang menderita Alzheimer. Logan harus mengalahkan Nathaniel Essex dengan bantuan seorang anak perempuan bernama Laura Kinney yang merupakan hasil kloning dari Wolverine', 'Action, Drama, Sci-fi', 2017, '2017-03-03', 136, 'James Mangold', 'James Mangold (story by), Scott Frank (screenplay), James Mangold (screenplay), Michael Green (screenplay)', 'Hugh Jackman, Patrick Stewart, Dafne Keen, Boyd Holbrook', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjI1MjkzMjczMV5BMl5BanBnXkFtZTgwNDk4NjYyMTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/DekuSxJgpbY\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3315342', 8.7, 77, 18, 29, NULL, 7.5, 2),
(34, 'LONDON LOVE STORY 2', 'Aku bersyukur..\r\nsemua hari hariku begitu berarti..\r\nDan Aku akan tetap minta sama Tuhan, \r\nuntuk ambil nyawa aku satu hari sebelum Tuhan ambil nyawanya\r\nKarena setiap detak jantungnya, adalah detik berharga untuk aku\r\n\r\nCaramel sangat bahagia. Betapa tidak, impiannya sejak kecil untuk melihat dan bermain salju akhirnya terwujud karena Dave memberinya hadiah kejutan liburan ke Swiss untuk merayakan ulang tahun Caramel.\r\n\r\nsaat mereka akan berangkat menggunakan kereta dari stasiun St. Pancras International London ke Swiss, Tiba-tiba Dave tidak bisa berangkat bersama Caramel.\r\n\r\nSesampainya di sana, Sam yang sudah menjemput Caramel membawa Caramel makan malam di sebuah resto terbaik di kota Zurich, hingga Caramel sangat terkesan.\r\n\r\nSayangnya kebahagiaan Caramel menikmati hari pertamanya di Swiss, terganggu karena kemunculan Gilang, seorang chef sekaligus cucu pemilik restoran di Swiss. Gilang meminta Caramel untuk menemuinya di sebuah restoran. Caramel datang dan menemui Gilang. Gilang memberikan sebuah hadiah untuk Caramel.\r\n\r\nSetelah itu Gilang meminta Caramel menemuinya lagi keesokan harinya. Apakah Dave tahu tentang ini, Apakah Gilang mengetahui kalau Caramel adalah tunangan Dave..??', 'Drama', 2017, '2017-03-03', 100, 'Asep Kusdinar', 'Sukhdev Singh, Tisa TS', ' Ramzi. Salshabilla Adriani. Mawar Eva', 'https://www.bioskoptoday.com/wp-content/uploads/2017/01/poster-london-love-story.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/_OeuFCIpFhg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3315342', 8.7, 77, 0, 0, '', 0, 2),
(35, 'MAX STEEL', 'Max McGrath (Ben Winchell) adalah seorang remaja berusia 16 tahun yang tengah beradaptasi dengan lingkungan barunya. Tidak lama sejak kepindahannya, ia menemukan bahwa sang almarhum ayah yang pernah bekerja sebagai ilmuwan telah mewariskan kekuatan super yang dapat merubah energi di sekelilingnya. \r\n\r\nKemudian Max juga bertemu dengan alien bernama Steel yang melatihnya untuk menggunakan kekuatannya sebagai seorang super hero bernama Max Steel. Ketika keduanya saling bekerja sama dalam misi membela kebenaran, beberapa makhluk misterius dari galaksi lain memburu Max untuk merebut kekuatan yang dimilikinya.', 'Action, Adventure, Family', 2016, '2016-10-14', 92, 'Stewart Hendler', 'Christopher Yost', 'Ben Winchell, Josh Brener, Maria Bello, Andy Garcia', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk2MTMwOTk3N15BMl5BanBnXkFtZTgwMDI5OTYxMDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/Tf4sa0BVJVw\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1472584', 4.6, 22, 0, 0, NULL, 6.5, 2),
(36, 'JAKARTA UNDERCOVER', 'MOAMMAR EMKAS JAKARTA UNDERCOVER - Demi mengejar cita-citanya menjadi wartawan, Pras (Oka Antara) berangkat ke Jakarta untuk berguru pada Djarwo (Lukman Sardi), pemimpin redaksi sebuah majalah berita. Idealisme Pras mulai luntur saat menyadari bahwa kecemerlangan tulisannya dimanfaatkan oleh kantornya untuk tujuan tertentu.\r\n\r\nJiwa Pras memberontak. Apalagi setelah ia bertemu Awink (Ganindra Bimo), penari malam, yang membawanya berkenalan dengan Yoga (Baim Wong), sosok penting di dunia bisnis \"gelap\" Jakarta. Di sisi lain, Pras bertemu dengan Laura (Tiara Eve), perempuan super model yang membuat hidupnya berbeda, begitupun Laura yang menganggap Pras anomali dari kebanyakan lelaki yang ditemuinya di Jakarta.\r\n\r\nTanpa disadari, Pras berada di tengah pusaran dunia antah berantah Jakarta. Semakin dalam ia menggali, semakin jauh ia terseret ke dalamnya. Bagaimana Pras menghadapi kerasnya kehidupan di Jakarta?', 'Drama', 2016, '2016-10-14', 107, 'Stewart Hendler', 'Christopher Yost', 'Ben Winchell, Josh Brener, Maria Bello, Andy Garcia', 'http://flickmagazine.net/foto_review/72moammar-emka-jakarta-undercover-movie-poster.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/5zMCsU5ncrM\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1472584', 4.6, 22, 11, 17, '', 0, 2),
(37, 'RINGS', 'Film yang merupakan seri ketiga dari trilogi The Ring ini terjadi sebelum pembuatan video terkutuk yang akan membunuh siapa saja yang pernah menontonnya. Selain itu film ini juga berfokus pada keseharian seorang pelajar bernama Julia (Matilda Lutz) dan kekasihnya, Holt (Alex Roe). \r\n\r\nKhawatir akan hubungan mereka yang semakin renggang, Julia memutuskan untuk pergi menemui Holt. Ketika ia sampai, Julia menemukan jika kekasihnya adalah anggota dari sebuah klub yang menyebarkan video terkutuk Samara. Selain itu, Julia harus dihadapkan dengan kenyataan bahwa Holt telah menonton video tersebut enam setengah hari yang lalu dan mereka harus menemukan jalan untuk menghentikan kutukan Samara sebelum terlambat.', 'Drama, Horror', 2017, '2017-02-03', 102, 'F. Javier Gutirrez', 'David Loucka (screenplay), Jacob Estes (screenplay), Akiva Goldsman (screenplay), David Loucka (story by), Jacob Estes (story by), Kji Suzuki (based on the novel ', 'Matilda Anna Ingrid Lutz, Alex Roe, Johnny Galecki, Vincent D\'Onofrio', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjU1NDAxNTg0MF5BMl5BanBnXkFtZTgwNzUxMjEwMTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/uukQ_6szDm8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0498381', 4.5, 25, 5, 11, NULL, 0, 2),
(38, 'SILENCE', 'Berkisah mengenai kedua misionaris Katholik (Andrew Garfield and Adam Driver) yang menghadapi ujian atas keyakinan merek ketika keduanya pergi ke Jepang untuk mencari guru mereka yang hilang (Liam Neeson) - tepat di saat keberadaan umat Katholik terancam di Jepang', 'Drama, History', 2016, '2017-01-13', 160, 'Martin Scorsese', 'Jay Cocks (screenplay), Martin Scorsese (screenplay), Shsaku End (based on the novel by)', 'Andrew Garfield, Adam Driver, Liam Neeson, Tadanobu Asano', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjY3OTk0NjA2NV5BMl5BanBnXkFtZTgwNTg3Mjc2MDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/A0KUWzfugg4\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0490215', 7.5, 79, 2, 5, NULL, 0, 2),
(39, 'SPLIT', 'Ketika ketiga gadis remaja sedang menunggu ayah mereka di dalam mobil, seorang pria misterius menculik dan membawa mereka ke dalam sebuah bunker. Sang penculik yang bernama Kevin (James McAvoy) adalah seorang pria dengan gangguan jiwa yang membuatnya memiliki 23 kepribadian yang berbeda, yang diantaranya adalah seorang wanita dan anak berumur 9 tahun yang bernama Hedwig. \r\n \r\nSebagai salah satu gadis yang diculik, Casey berusaha meloloskan diri dengan meyakinkan salah satu kepribadian Kevin untuk melepaskan mereka. Akan tetapi hal tersebut tidaklah mudah, terlebih setelah Hedwig memperingatkan mereka akan the Beast yang merupakan kepribadian Kevin yang paling berbahaya.', 'Horror, Thriller', 2016, '2017-01-20', 117, 'M. Night Shyamalan', 'M. Night Shyamalan', 'James McAvoy, Anya Taylor-Joy, Betty Buckley, Haley Lu Richardson', 'https://images-na.ssl-images-amazon.com/images/M/MV5BZTJiNGM2NjItNDRiYy00ZjY0LTgwNTItZDBmZGRlODQ4YThkL2ltYWdlXkEyXkFqcGdeQXVyMjY5ODI4NDk@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/84TouqfIsiI\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4972582', 7.5, 62, 18, 37, NULL, 0, 2),
(40, 'SURGA YANG TAK DIRINDUKAN 2', 'Pertemuan dengan Arini membuat Meirose menjadi ragu dengan pilihan hidupnya selama ini. Arini begitu tulus menyayangi dirinya dan Akbar, dan berharap agar Meirose kembali pada Pras. Mereka sudah menjadi keluarga. Apalagi ketika sosok Pras muncul dihadapannya, Meirose tidak bisa mengingkari bahwa cintanya pada laki-laki bijak itu masih ada dalam hatinya. Bahkan Arini didukung Nadia, berusaha keras menarik Meirose kembali.\r\n\r\nMeirose bingung, maju dengan kehidupannya yang baru, yang dia sendiri tidak tahu akan jadi seperti apa, ataukah mundur pada kehidupannya yang lama, yang ingin dia tinggalkan selama ini, tapi menjanjikan hal yang lebih pasti bagi masa depannya?\r\n\r\nAda apa dibalik motivasi Arini yang menggebu-gebu meminta Meirose kembali dalam kehidupan rumah tangganya yang sudah harmonis selama ini?\r\n\r\nApa yang akan dilakukan Pras, akankah dia kembali menerima Meirose? Sementara, dia meragukan kemampuannya untuk bersikap adil sebagaimana yang diwajibkan Allah pada laki-laki yang memilih berpoligami?\r\n\r\nSiapa juga Dokter Syarief(Reza Rahardian) yang tiba-tiba hadir di tengah-tengah persoalan mereka?\r\n\r\nLalu mengapa surga itu tiba-tiba menjadi dirindukan sekarang?', 'Drama', 2017, '2017-02-09', 121, 'Hanung Bramantyo, Meisa Felaroze', 'Alim Sudio, Hanung Bramantyo, Manoj Punjabi', 'Reza Rahadian, Raline Shah, Laudya Cynthia Bella, Fedi Nuril', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTZiZjU4MDEtOWFjZS00YWZkLTg1MGMtNDcxNTdhMDE3NWU2XkEyXkFqcGdeQXVyNjU3MzA0NjE@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/DpUXJVbb894\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5946936', 0, 0, 0, 0, NULL, 0, 2),
(41, 'ULAR TANGGA', 'FINA (20), mahasiswi berwatak serius dan memiliki potensi indigo, sebenarnya sudah memiliki firasat buruk. Mimpi buruk yang muncul dalam tidurnya seperti menghidupkan alarm bahaya dalam diri FINA. Hal itu terkait dengan rencana mendaki gunung tim pecinta alam kampusnya. Kebetulan, tim yang akan berangkat dalam pendakian itu dipimpin BAGAS (21), kekasih FINA. BAGAS tidak percaya pada kekhawatiran FINA. Ia malah membujuk FINA untuk tetap berangkat bersama tim pecinta alam yang beranggotakan empat mahasiswa lain: MARTHA, WILLIAM, DODOY, dan LANI. Pada tahap awal, perjalanan mereka dibantu GINA, seorang pendaki dan penunjuk jalan yang sudah lebih dulu berpengalaman dan mengenal medan di gunung tersebut.\r\n\r\nSayangnya, peringatan GINA agar mereka memilih jalan yang aman, tidak diindahkan oleh teman-teman FINA. Tanpa mereka sadari, jalan yang mereka pilih mengantarkan mereka menuju pohon tua yang angker dan rumah misterius di gunung yang memiliki cerita kelam di masa lalu. FINA baru menyadari bahaya mengancam dirinya dan teman-temannya. Kemunculan dua hantu anak kecil, SANIA dan TANIA, seolah menjadi pertanda akan bahaya yang mengancam mereka. Mereka tersesat di gunung, dan terpaksa bertahan di rumah misterius yang sudah kosong bertahun-tahun.\r\n\r\nNamun, saat mereka berkeinginan turun gunung segalanya sudah terlambat. Kejadian buruk menimpa mereka satu per satu. Semua itu diawali dengan penemuan permainan kuno ular tangga yang terbuat dari kayu, di bawah pohon angker itu. Penemuan itu memunculkan kembali hantu yang sangat berbahaya. Hantu yang penuh kemarahan karena pohon angker yang menjadi tempat tinggalnya, dirusak pada masa lalu. Seseorang telah memotong cabang pohon tersebut dan membuatnya menjadi ukiran permainan ULAR TANGGA. Peristiwa terkutuk yang memakan korban jiwa.', 'Thriller', 2016, '2016-12-11', 94, 'Arie Azis', 'N/A', 'Shareefa Daanish, Guntur Triyoga, Fauzan Nasrul, Alessia Cestaro', 'http://ia.media-imdb.com/images/M/MV5BNTA4OWE2MDItZGQ2My00YWU2LTkyOWYtMWViMDQ0YjcyMmEzXkEyXkFqcGdeQXVyMjIyNDU1OTg@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/NgATJRgFlHg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5742836', 0, 0, 2, 0, '', 0, 2),
(42, 'GUARDIANS OF THE GALAXY 2', 'Pada seri kedua film Guardian of the Galaxy, Peter Quills (Chris Pratt) dan para Guardians kembali melanjutkan petualangan mereka dengan menjelajahi bagian terluar dari kosmos. Kali ini, persahabatan para Guardians akan diuji pada saat mereka mengungkap misteri dari silsilah keluarga Peter Quill. Di film ini juga, seorang musuh lama akan muncul kembali untuk membantu para Guardians dalam misi mereka', 'Action, Adventure, Sci-fi', 2017, '2017-06-17', 137, 'James Gunn', 'James Gunn, Dan Abnett', 'Chris Pratt, Zoe Saldana, Sylvester Stallone', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg2MzI1MTg3OF5BMl5BanBnXkFtZTgwNTU3NDA2MTI@._V1_UY1200_CR90,0,630,1200_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/duGqrYw4usE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3896198', 0, 0, 0, 0, '', 0, 2),
(43, 'THE INFILTRATOR', 'Seorang pejabat Bea Cukai AS Robert Mazur (Bryan Cranston) melakukan penyamaran untuk menyusup ke dalam jaringan perdagangan narkoba yang diatur oleh mafia besar asal Kolumbia, Pablo Escobar.\r\n\r\nMazur menyamar sebagai Bob Musella seorang pengusaha pencucian uang. Dengan penuh resiko yang mengancam keselamatan jiwanya, Mazur bersama agen lainnya mencoba membongkar praktik pencucian uang yang dilakukan Pablo dengan bangkir korup dan 85 gembong narkoba lainnya.', 'Biography, Crime, Drama', 2016, '2016-07-13', 127, 'Brad Furman', 'Ellen Sue Brown (screenplay), Robert Mazur (based on the book on)', 'Bryan Cranston, Leanne Best, Daniel Mays, Tom Vaughan-Lawlor', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTEwNzM2NjY2MTNeQTJeQWpwZ15BbWU4MDQ3MDI3Njgx._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/N7_M4hjXW1I\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1355631', 7.1, 66, 0, 1, NULL, 0, 2),
(45, 'GET OUT', 'Film ini mengisahkan seorang pemuda berkulit hitam bernama Chris (Daniel Kaluuya) yang mengunjungi rumah orang tua kekasihnya yang berkulit putih Rose (Allison Williams).\r\n\r\nDia tak pernah mengira kunjungannya akan menjadi sebuah kejadian yang buruk bagi dirinya hingga seorang pria sesama kulit hitam memperingatkannnya untuk \"keluar\". Kemudian Chris menyadari bahwa untuk \"Keluar\" jauh lebih sulit dari yang ia bayangkan.', 'Horror, Mystery', 2017, '2017-02-24', 104, 'Jordan Peele', 'Jordan Peele', 'Daniel Kaluuya, Allison Williams, Catherine Keener, Bradley Whitford', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTE2Nzg1NjkzNV5BMl5BanBnXkFtZTgwOTgyODMyMTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/sRfnevzM9kQ\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5052448', 8.2, 84, 37, 48, NULL, 0, 2),
(46, 'KARTINI', 'Kartini tumbuh dengan melihat langsung bagaimana ibu kandungnya, Ngasirah (Christine Hakim) menjadi orang terbuang di rumahnya sendiri, dianggap pembantu hanya karena tidak mempunyai darah ningrat. Ayahnya, Raden Sosroningrat (Deddy Sutomo), yang mencintai Kartini dan keluarga juga tidak berdaya melawan tradisi.\r\n\r\nSepanjang hidupnya, Kartini memperjuangkan kesetaraan hak bagi semua orang, tidak peduli ningrat atau bukan, terutama hak pendidikan untuk perempuan. Bersama kedua saudarinya, Roekmini (Acha Septriasa) dan Kardinah (Ayushita Nugraha), Kartini mendirikan sekolah untuk kaum miskin dan menciptakan lapangan kerja untuk rakyat di Jepara dan sekitarnya. \r\n\r\nFilm Kartini adalah perjuangan emosional dari sosok Kartini yang harus melawan tradisi dan bahkan menentang keluarganya sendiri untuk memperjuangkan kesetaraan hak untuk semua orang di Indonesia.', 'Biography, Drama, Family', 2017, '2017-04-01', 122, 'Hanung Bramantyo', 'Bagus Bramanti, Hanung Bramantyo, Hanung Bramantyo, Robert Ronny (additional stories), Robert Ronny (story)', 'Adinia Wirasti, Reza Rahadian, Christine Hakim, Dian Sastrowardoyo', 'https://images-na.ssl-images-amazon.com/images/M/MV5BZDZjY2EzZjAtODQzOC00NmE1LTk1MGYtOGQ4YWYyN2I3NmY0XkEyXkFqcGdeQXVyMTE4OTcyMA@@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/ePQV41Rk9uw\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5882416', 8.1, 0, 31, 2, NULL, 0, 2),
(47, 'THE GUYS', 'Alfi, seorang karyawan yang bercita-cita jadi bos, ingin mendapatkan cinta Amira, teman sekantornya. Namun, masalah timbul ketika Via, gebetan abadinya, yang tadinya mengabaikan Alfi, mulai menujukkan rasa cinta..  Di satu sisi, ketika Alfi dekat dengan Amira, ternyata', 'Drama', 2017, '2017-05-01', 84, 'Raditya Dika', 'Raditya Dika', 'Raditya Dika, Pevita Pearce, Marthino Lio', 'https://images-na.ssl-images-amazon.com/images/M/MV5BYmQyZDZkNzYtNzQ3My00ZjVjLWE2MTctNzcxZDIzZDY1MGJiXkEyXkFqcGdeQXVyNTg2MDI2Njc@._V1_SY1000_CR0,0,679,1000_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/JxTmtJ0Fc2U\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0319470', 6.5, 60, 87, 174, '', 0, 2),
(48, 'LABUAN HATI', 'Bia, Indi dan Maria adalah tiga perempuan yang bertemu di Labuan Bajo, Flores, NTT. Hidup di atas kapal, menyelam, bertemu komodo hingga menginap di sebuah pulau yang sama... Tiga perempuan dengan latar belakang berbeda, alasan berbeda, dan tujuan berbeda dengan cepat bersahabat karena kecintaan yang sama: kepada laut, permukaan maupun kedalaman.\r\n\r\nDan ada Mahesa, instruktur diving yang terus mendampingi mereka, yang kemudian menjadi salah satu alasan mereka merasa ada yang salah dengan hidup masing-masing.\r\n\r\nPadahal... tak ada yang salah. Setiap perempuan berhak bersedih atas masa lalu, berhak berbahagia untuk hari ini, dan berhak selalu punya harapan akan masa depan, tanpa perlu mengutuk hidup yang tak melulu baik-baik saja.', 'Drama', 2017, '2017-02-20', 101, 'Lola Amaria', 'Titien Wattimena', 'Kelly Tandiono, Nadine Chandrawinata, Ully Triani', 'https://www.sukamoviedrama.co/wp-content/uploads/2017/03/Labuan_Hati.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/D3S_F07qmkY\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0319470', 6.5, 60, 1, 0, '', 0, 2),
(49, 'HAND OF STONE', 'Hands of Stone akan berkisah tentang kehidupan Roberto Duran (Edgar Ramirez) yang menjadi seorang petinju profesional saat masih berusia 16 tahun. \r\n\r\nDibawah pelatih Ray Arcel (Robert De Niro) Ia menjadi salah satu petarung hebat di masanya dengan mengalahkan petinju terkenal Sugar Ray Leonard.', 'Drama', 2017, '2017-11-20', 110, 'Jonathan Jakubowicz', 'Jonathan Jakubowicz', 'Edgar Ramirez, Ellen Barkin, John Turturro', 'http://dl9fvu4r30qs1.cloudfront.net/78/8e/a38868bc460cbbfd59f7961ada69/hands-of-stone-poster.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/1W1L0WnVnjY\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0319470', 6.5, 60, 0, 0, '', 0, 2);
INSERT INTO `film` (`id`, `title`, `summary`, `genre`, `year`, `playing_date`, `length`, `director`, `writer`, `actors`, `poster`, `trailer`, `imdb_id`, `imdb_rating`, `metascore`, `twitter_positif`, `twitter_negatif`, `twitter_search`, `rating`, `status`) VALUES
(50, 'MIDDLE SCHOOL: THE WORST YEARS OF MY LIFE', 'MIDDLE SCHOOL: THE WORST YEARS OF MY LIFE\r\n\r\nRafe Khatchadorian (Griffin Gluck) adalah remaja yang memiliki imajinasi tinggi. Namun ia punya banyak masalah, mulai dengan pacar sang Ibu sampai lingkungan baru di sekolah. \r\n\r\nMasalah terbesar Rafe adalah sang kepala sekolah Dwight (Andrew Daly) yang selalu mengekang kreativitas murid di sekolah dan ketat terhadap peraturan. \r\n\r\nMisi dilakukan Rafe bersama Leo (Thomas Barbusca) dan teman-tema sekolanya untuk membalas perlakuan sang kepala sekolah yang otoriter.', 'Comedy, Family', 2016, '2016-10-07', 92, 'Steve Carr', 'Chris Bowman (screenplay), Hubbel Palmer (screenplay), Kara Holden (screenplay), James Patterson (based on the book by), Chris Tebbetts (based on the book by)', 'Griffin Gluck, Lauren Graham, Alexa Nisenson, Andrew Daly', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjQzMTczNjI0Ml5BMl5BanBnXkFtZTgwODY5MTY5OTE@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/XQtjPUyS6ZY\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4981636', 6.1, 51, 0, 0, '', 0, 2),
(51, 'SWEET 20', 'Fatmawati (Niniek L Karim), nenek 70 tahun cerewet yang tinggal bersama putranya seorang dosen, Aditya (Lukman Sardi), menantu (Cut Mini), dan 2 orang cucu (Kevin Julio, Alexa Key). Fatmawati selalu membanggakan Aditya, sampai suatu hari ia mengetahui akan dikirim ke panti jompo. Hal yang membuatnya sangat terpukul dan pergi dari rumah. Di perjalanan ia melihat studio foto Forever Young, dan berniat mengambil foto untuk di pemakamannya kelak. Namun setelah berfoto Fatmawati berubah menjadi 50 tahun lebih muda, dan kembali berusia 20 tahun. Fatmawati pun memulai kehidupan yang baru dan mengganti namanya menjadi Mieke, seperti nama artis idolanya Mieke Wijaya. Seiring berjalannya waktu, Mieke mendapat kesempatan untuk meraih mimpinya menjadi penyanyi, sesuatu yang tidak bisa dilakukannya pada saat muda dulu. Keunikan Mieke muda dengan gaya bicara dan seleranya yang masih seperti nenek 70 tahun, justru membuat 3 pria jatuh hati padanya, seorang produser musik (Morgan Oey), cucu laki-lakinya, dan Hamzah (Slamet Rahardjo) yang mencintainya sejak sama-sama muda dulu.\r\n\r\nHingga suatu peristiwa terjadi, yang membuat Mieke harus memilih untuk melanjutkan kehidupan barunya, atau kembali menjadi Fatmawati.', 'Comedy, Family', 2016, '2016-10-07', 92, 'Steve Carr', 'Chris Bowman (screenplay), Hubbel Palmer (screenplay), Kara Holden (screenplay), James Patterson (based on the book by), Chris Tebbetts (based on the book by)', 'Griffin Gluck, Lauren Graham, Alexa Nisenson, Andrew Daly', 'https://upload.wikimedia.org/wikipedia/en/6/6a/Sweet_20.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/dZb6uIoVFIg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4981636', 6.1, 51, 0, 0, '', 0, 2),
(52, 'THE CURSE', 'Shelina seorang pengacara ekspatriat Indonesia bekerja disalah satu law firm ternama di Melbourne Australia.\r\n \r\nSuatu malam Shelina didatangi roh halus di rumahnya. Penampakan roh halus itu semakin hari semakin jelas dan sangat menakutkan. Akhirnya Shelina memanggil paranormal dari Indonesia guna melakukan pengusiran. Hasil ritual paranormal menemukan, roh halus itu mendatangi Shelina untuk menyampaikan pesan. Dan roh halus itu mempunyai kaitan yang sangat erat dengan Shelina.\r\n \r\nTeka teki dibalik kedatangan roh halus, membuat Shelina harus menghadapi sesuatu yang sangat menakutkan.', 'Sci-Fi, Horror', 2017, '2017-05-11', 92, 'David Keith', 'David Chaskin (screenplay)', 'Wil Wheaton, Claude Akins, Malcolm Danare, Cooper Huckabee', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOTZhM2M1NGItZTdhNS00ODMxLWJjYTQtNTQ2Yzg4ZWZhMTM2XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/rvmN3mZIqdI\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0092809', 4.9, 0, 0, 0, '', 0, 2),
(53, 'SURAU DAN SILEK', 'Adil (11th) adalah seorang anak yatim yang sangat menginginkan Ayah nya masuk surga dengan cara menjadi anak yang shaleh. Di saat yang bersamaan Adil juga sangat berambisi memenangkan pertandingan Silat di kampungnya. Ambisi Adil ini di dasari oleh kekalahan yang di alaminya pada pertandingan periode sebelumnya. Adil di kalahkan oleh Hardi (11Th) dengan kecurangan. Namun hal ini tidak di akui oleh Hardi. Karena menurut Hardi, Adil hanya mencari-cari alasan atas kekalahannya. Teman seperguruan Adil yang juga merupakan sahabatnya; Dayat (11th) dan Kurip (11th) ikut mendukung upaya membalaskan dendam kekalahan tersebut. \r\n \r\nDengan semangat yang tinggi mereka mempersiapkan diri menuju pertandingan berikutnya yang akan di adakan 6 bulan lagi. Dalam masa persiapan tersebut tiga sekawan; Adil, Dayat dan Kurip mengalami berbagai rintangan; Mulai dari guru silat mereka Rustam (27) yang pergi merantau, keinginan Adil untuk menjadi anak shaleh yang kadang bertentangan dengan ambisinya, pertikaian yang terjadi di antara Tiga Sekawan dalam memandang makna silat, Hardi dan kawan-kawan yang selalu mem-bully Adil, Dayat dan Kurip serta pencarian guru silat pengganti yang gagal disaat waktu menuju pertandingan terus berjalan.\r\n \r\n Rani (11th) merupakan teman sekolah Tiga sekawan (Adil, Kurip dan Dayat). Rani yang mengagumi Adil secara diam diam berusaha untuk mencarikan solusi terhadap kegalauan yang di hadapi oleh teman-temannya. Berkat usaha Rani inilah semua rintangan yang di hadapi oleh Tiga sekawan ini dapat teratasi. Berhasilkah Tiga Sekawan menemukan guru silat serta memenangkan pertandingan? ', 'Drama, Religi', 2017, '2017-04-11', 92, 'Arief Malinmudo', 'Arief Malinmudo', 'Dewi Irawan, Gilang Dirga, Komo Ricky', 'https://upload.wikimedia.org/wikipedia/id/thumb/5/5a/Poster_Film_Surau_Dan_Silek.jpg/1200px-Poster_Film_Surau_Dan_Silek.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/unyKxrBdHdA\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0092809', 4.9, 0, 0, 0, '', 0, 2),
(54, 'HITAM DAN PUTIH', 'Ruanli dan Ashui adalah kakak beradik. Ruanli bekerja sebagai pelatih bela diri sedangkan Ashui diam-diam bekerja sebagai pemain film tanpa tahu Ruanli.\r\n\r\nSementara Yurong adalah seorang wanita polisi yang sedang menyamar, dia sedang menyelidiki kasus Narkoba kelompok Chutian. Chutian adalah direktur utama berasal dari Hongkong, dia berbisnis tempat hiburan tapi sebenarnya berbisnis gelap narkoba. \r\n\r\nRuanli dan Megda sedang berakting sebagai polisi dan penjahat. Disaat yang bersamaan Ashi dan Jinmao membawa tas hitam dengan uang. Ashi dan Jinmao kira Ruanli adalah polisi, kaget dan buru-buru kabur dengan membawa uang. Untuk menghindar dari kejaran Ruanli, uang itu di simpannya di sebuah motor yang ternyata itu adalah motor Ashui. \r\n\r\nRuanli, Adang, Azun dan Ganni merencanakan untuk menyelamatkan Ashui dari tangan Chutian. Terjadi pertukaran antara Ashui dengan Tas hitam tanpa diduga ternyata Chutian merencanakan sesuatu sampai Chutian berhasil membawa kabur Ashui sebagai sandera. Chutian berhasil di kepung, dengan akal liciknya dia berusaha membuang barang bukti demi menghindar dari hukum. \r\n\r\nBagaimana akhir kisahnya, saksikan di bioskop mulai 13 April 2017.', 'Drama, Action', 2017, '2017-04-13', 91, 'Daud Radex', 'Susan Yu', 'Roger Danuarta, Guntur Triyoga, Sunny Pang', 'https://1.bp.blogspot.com/-Ojs5SidrTzQ/TqpyF_wJbAI/AAAAAAAAOIU/A_4j_pwOLH4/s1600/girl-dragon-tattoo-535x809.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/vhiK5cDluhc\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5351016', 0, 0, 0, 0, '', 0, 2),
(55, 'MENGEJAR HALAL', 'Kisah Haura berawal dengan batalnya pernikahan Haura dan Shidiq. Kegagalan pernikahan membuat Haura menjadi wanita yang terobsesi pada pernikahan sempurna, baginya butuh pria sempurna untuk mendapatkan pernikahan sempurna. Ditengah kegalauan menanti sosok pria sempurna, Haura dipertemukan dengan sosok Halal, pria yang memiliki semua yang diharapkan haura ada pada pasangan hidupnya.\r\n\r\nHaura melakukan segala cara demi menjadikan Halal pasangan hidupnya, Hubungan Haura dengan saudara dan sahabat-sahabatnya mulai renggang karena sikap egois Haura yang semakin tak terkendali kala mengejar Halal. Mampukah Haura mendapatkan Halal dan meraih pernikahan sempurna impiannya?', 'Drama, Comedy', 2010, '2010-11-01', 75, 'M. Amrul Ummami', 'M. Ali Ghifari', 'Inez Ayuningtyas, Abdul Kaafi, Ressa Rere, Ryan Qori, Ahmad Rhezanov', 'https://2.bp.blogspot.com/-v5Hyc9KY0Yw/WC6bQ6xPOPI/AAAAAAAAIPY/Bg0nWD7fyPUlHUj7RW6EUBbgImFvaBJkQCEw/s1600/WhatsApp+Image+2016-11-17+at+6.13.03+PM.jpeg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/skSeKOOvMgg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5351016', 0, 0, 21, 8, '', 0, 2),
(56, 'NIGHT BUS', 'Bis Babad mengangkut beberapa penumpang menuju Sampar, sebuah kota yang terkenal kaya akan sumber daya alamnya namun terjadi konflik berkepanjangan. Sampar dijaga ketat oleh aparat pemerintah pusat yang siap siaga melawan pasukan Samerka (Sampar Merdeka), para milisi pemberontak yang menuntut kemerdekaan atas tanah kelahiran mereka.\r\n\r\nSetiap penumpang bis memiliki tujuannya masing- masing : mencari penghidupan yang lebih baik, memenuhi kebutuhan keluarga, menyelesaikan masalah pribadi atau sesederhana ingin pulang ke kampung halaman.\r\n\r\nMereka berpikir bahwa ini akan menjadi perjalanan seperti biasa, tanpa mereka sadari ada penyusup masuk ke dalam bis, membawa pesan penting yang harus di sampaikan ke Sampar. \r\n\r\nKehadiran penyusup membahayakan semua penumpang, orang paling dicari oleh kedua pihak yang bertikai, perintahnya temukan hidup atau mati!!\r\n\r\nSituasi menjadi semakin menegangkan ketika seluruh penumpang harus memperjuangkan hidupnya di antara desingan peluru. \r\n\r\nMereka bahkan harus menghadapi pihak lain yang justru tidak menginginkan konflik berakhir. Kaum oportunis, pemelihara konflik karena mereka hidup dari konflik, kesadisan dan kebengisan mereka semakin memberikan teror pada para penumpang bus.\r\n\r\nTidak ada yang tahu, siapa akan hidup dan siapa akan mati?!', 'Drama, Thriller, Action', 2007, '2007-05-11', 135, 'Emil Heradi', 'Rahabi Mandra', 'Yayu Unru, Teuku Rifnu Wikana, Hana Prinantina', 'https://images-na.ssl-images-amazon.com/images/M/MV5BM2EwNzgwYTEtNzI2Ny00OThhLWFjNWEtNmFlMjljODRiMzc4XkEyXkFqcGdeQXVyMzMzNjk0NTc@._V1_UY1200_CR110,0,630,1200_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/VO9hVH6k3F0\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0865924', 6.8, 0, 0, 0, '', 0, 2),
(57, 'BEST FRIEND FOREVER', 'Berkisah tentang ke empat remeja perempuan, Bianca(19th), Laura(18th), Sascha(19th) dan Tammy(18th) berencana menghabiskan jumat malam bersama. Kali ini Bianca merencanakan dengan sangat tertata, tidak seperti malam-malam sebelumnya. Namun, kenyataan tak seperti apa yang mereka berempat bayangkan. Rencana yang Bianca buat berubah 180 derajat, dan menjadi malapetaka.\r\n\r\nBianca, Laura, Sascha dan Tammy menjalani malam yang penuh dengan malapetaka yang datang hilir berganti menghampiri mereka berempat.\r\n\r\nPerjuangan Bianca, Laura, Sascha dan Tammy keluar dari situasi buruk, berujung Bianca harus kehilangan jejak pria idamannya. Yang membuat Bianca marah besar, sehingga memicu perkelahian diantara mereka berempat.\r\n\r\nDi malam yang sama Keempat sahabat ini menghadapi aksi-aksi berbahaya yang hampir merenggut nyawa dan membuat persahabatan mereka hancur.\r\n\r\nTingkah polos Bianca, Sascha, Tammy dan Laura dalam mengahadapi masalah membuat kekonyolan yang sangat lucu dan mampu memberikan arti tersendiri diantara mereka.\r\n\r\nNamun apakah Bianca, Sascha, Tammy dan Laura akan keluar dari mala petaka yang mengejar mereka pada malam itu ? Apa mungkin persahabatan mereka kembali baik seperti semula. Mampukah Bianca bertemu pria idamannya, serta siapakah pria idaman Bianca ? Saksikan kisah mereka dalam film Best Friends Forever, yang akan tayang di bioskop 6 April 2017.', 'Short, Comedy', 2012, '2012-07-19', 0, 'Estelle Linden', 'M. Rizkhi Faiz', 'Wendy Wilson, Kezia Karamoy, Yova Gracia, Ineke Valentina', 'http://cdn.wegotthiscovered.com/wp-content/uploads/BestFriendsForeverPoster.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/WFox4ttcPM8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2558934', 0, 0, 0, 0, '', 0, 2),
(65, 'PHILLAURI', 'Seorang pemuda asal Mangalik, Kanan (Suraj Sharma) menikahi sebuah pohon sebagai ritual tolak bala agar dapat menikahi wanita pilihannya. \r\n\r\nNamun tanpa di sangka-sangka pohon yang ia nikahi tersebut berisi roh halus yang kemudian terus mengikuti langkah Kanan.', 'Comedy, Drama, Fantasy', 2017, '2017-03-24', 134, 'Anshai Lal', 'Anvita Dutt', 'Anushka Sharma, Diljit Dosanjh, Suraj Sharma, Mehreen Pirzada', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA5Mjc3MTYyMl5BMl5BanBnXkFtZTgwMTgzNDkzMTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/uCTr7MGFK0U\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5502766', 7.5, 0, 0, 0, NULL, 0, 2),
(69, 'SPIRITED AWAY', 'Film animasi karya sutradara ternama Jepang Hayao Miyazaki ini bercerita tentang kisah seorang gadis berumur 10 tahun bernama Chihiro dan kedua orangtuanya yang masuk ke sebuah tempat yang terlihat sebagai sebuah taman hiburan yang terabaikan. \r\n\r\nSetelah kedua orangtuanya berubah menjadi babi raksasa, Chihiro bertemu dengan sosok misterius Haku yang menjelaskan kepadanya bahwa tempat mereka berada adalah sebuah resort di mana makhluk supernatural berisitrahat dari alam duniawi. Untuk dapat membebaskan kedua orangtuanya, Chihiro harus bekerja di sebuah bath house yang dikepalai oleh penyihir bernama Yubaba.', 'Animasi, Drama', 2003, '2003-03-28', 122, 'Hayao Miyazaki', 'Hayao Miyazaki', 'Rumi Hiiragi, Miyu Irino, Mari Natsuki, Takashi Nait', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk3NTM1NTg1Ml5BMl5BanBnXkFtZTgwOTgzMTMyMDE@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/ByXuk9QqQkk\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0245429', 8.6, 94, 0, 0, 'SPIRITED AWAY, GHIBLI ANIME', 0, 2),
(70, 'CRITICAL ELEVEN', 'Melalui Critical Eleven, pemenang Piala Citra Reza Rahadian dan Adinia Wirasti menghidupkan Ale dan Anya dari novel national bestseller karya Ika Natassa, pasangan muda yang bertemu dan saling terpikat dalam penerbangan Jakarta-Sydney. Pertemuan itu membawa mereka ke jenjang pernikahan, dan membuat keduanya mengambil keputusan besar sebagai pasangan karena pengorbanan yang harus dilakukan salah satu dari mereka: pindah ke New York.\r\n\r\nKota yang tidak pernah tidur ini ternyata membawa berkah bagi keduanya: kehamilan Anya yang mengubah hidup mereka. Sampai Ale dan Anya diterjang sebuah insiden yang membuat mereka tidak hanya mempertanyakan cinta, namun juga bergumul dengan ego dan harus memilih: menyerah dalam amarah atau menyembuhkan luka dan bertahan dalam ketidakpastian. Pilihan sulit itu bertambah pelik dengan kehadiran seseorang yang sudah lama mencintai Anya.', 'Drama', 2017, '2017-01-15', 120, 'Monty Tiwa', 'Jenny Jusuf, Ika Natassa', ' Reza Rahadian, Mark C. Fullhardt, Hannah Al Rashid', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjNhNDI0YWEtNDlhNi00ZGFmLThjZDgtZDFmMTk0Y2E5NzQ1XkEyXkFqcGdeQXVyMjgzNTIxNDE@._V1_SY1000_CR0,0,799,1000_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/tn-IiueNqsY\" frameborder=\"0\" allowfullscreen></iframe>', 'tt6426714', 7.8, 0, 0, 0, '', 0, 2),
(98, 'SMURFS THE LOST VILLAGE', 'Ketika Smurfette (Demi Lovato) menemukan sebuah peta misterius, ia bersama para sahabatnya Brainy, Clumsy dan Hefty pergi dalam sebuah petualangan menuju sebuah hutan terlarang yang dihuni oleh hewan ajaib untuk mecari sebuah desa misterius sebelum penyihir jahat Gargamel menemukannya. Dengan melalui perjalan yang dipenuhi rintangan dan bahaya, para Smurf akan menemukan sebuah rahasia terbesar dalam sejarah kaum Smurf.', 'Animation, Adventure, Comedy', 2017, '2017-04-07', 89, 'Kelly Asbury', 'Stacey Harman, Pamela Ribon, Peyo (based on the characters and works of)', 'Demi Lovato, Rainn Wilson, Joe Manganiello, Jack McBrayer', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg1NjgyMTYzM15BMl5BanBnXkFtZTgwMzIxNDc4MDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/vu1qZCG6Yo8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2398241', 5.8, 40, 1, 1, NULL, 0, 2),
(113, 'SATRIA HEROES REVENGE OF DARKNESS', 'Satu tahun telah berlalu semenjak satria Garuda Bima X mengalahkan Vudo. Warga Jakarta hidup dalam keadaan damai. Ray bersama Rena sedang menjaga kedamaian dan membangun dunia pararel kembali. \r\n\r\nDi bumi, Dimas Akhsara sedang mengembangkan bisnisnya ke Jepang dan bertemu dengan pimpinan Takarada Corp. Akan tetapi kekuatan jahat baru kembali menyerang dan Dimas menjadi korbannya. \r\n\r\nRay yang berada di dunia pararel memutuskan untuk kembali ke bumi untuk menyelidiki. Tanpa sepengetahuan Ray, musuh lama kembali bangkit dan memporak-porandakann Jakarta. Pertarungan sengit tidak terhindari.', 'Drama', 2017, '2014-11-01', 120, 'Kenzo Maihara, Arnandha Wyanto', 'Reino Barack, Ishimori Production', 'Christian Loho,Fernando Surya, Yayan Ruhian, Adhitya Alkatiri', 'https://upload.wikimedia.org/wikipedia/id/thumb/c/c7/Satria_heroes_poster.jpg/270px-Satria_heroes_poster.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/uKTu5gX1g4Q\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '', 0, 2),
(114, 'SETERU', 'Bertahun-tahun tawuran antara SMA Kesatuan Bangsa dan SMA Budi Pekerti di kota Yogyakarta berlangsung hingga memakan korban jiwa dan mewariskan dendam antar angkatan. SMA Kesatuan Bangsa didominasi siswa keturunan kelas menengah ke atas, sementara SMA Budi Pekerti didominasi oleh siswa pribumi kelas menengah bawah. \r\n\r\nPimpinan kedua sekolah sepakat untuk menyerahkan pentolan tawuran dari masing-masing sekolah untuk dibina oleh Letnan Kolonel RAHMAT (Mathias Muchus) sebagai Komandan Kodim yang menaungi kedua sekolah tersebut. Letkol Rahmat kemudian menugaskan pembinaan anak-anak tersebut kepada Letnan Satu MAKBUL (Alfie Alfandy), seorang perwira cemerlang yang dikenal keras kepada anak buah. Anak-anak itu, yang dipimpin MARTIN TAN (Bio One) dan RIDWAN (Yusuf Mahardika) dimasukkan ke Batalyon Inftantri 403 Wirasada Pratista di Kentungan, Yogyakarta.\r\n\r\nTempaan pembinaan meluluhkan perbedaan dan permusuhan di antara kedua kelompok itu, bahkan mereka bersatu menjadi kelompok olah raga futsal yang berprestasi. Tapi itu semua tidak mudah karena masih ada teman-teman mereka sendiri yang masih ingin memelihara dendam. Bahkan, ketika mereka bersiap meraih prestasi, teror dan dendam masih membayangi mereka. Dapatkah mereka mengatasi dendam dan perbedaan?', 'Drama', 2017, '2017-03-01', 120, 'Hanung Bramantyo', 'Bagus Bramanti', 'Yusuf Mahadika, Bio One Mathias, Muchus Mathias, Alfie Alfandy', 'https://pbs.twimg.com/media/C-ymgkbUwAAWvtb.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/0mnsgj8W6rU\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '', 0, 2),
(115, 'SELEBGRAM', 'Kamal (Aldi Maldini) baru saja lulus kuliah. Kehidupannya berubah drastis ketika Bapaknya bangkrut. Semua kekayaannya ludes. Kisah cinta yang dibina bersama Billa (Barbie) juga kandas. Calon mertuanya memutuskan rencana pernikahan mereka.\r\n\r\nHidup Kamal bagaikan diujung tanduk ketika bapaknya berutang banyak pada rentenir. Meskipun begitu, Kamal selalu mencari jalan untuk membantu Bapaknya. Dia berharap bisa menjadi Selebgram agar bisa mendapat endorse dan menghasilkan uang. Sayang, menjadi Selebgram bukanlah perkara mudah.\r\n\r\nKamal putus asa. Cinta dan harta telah berpaling darinya. Ditengah keputus asaan itu, Kamal bertemu dengan Cello (Syifa Hadju). Gadis tunawicara itu mengubah jalan hidupnya. Cinta menggetarkan hati Kamal dan membuatnya mampu menghadapi semua persoalan dibantu dengan Sherly (Ria Ricis), Kakak Cello.\r\n\r\nBagaimana Kamal mengatasi semua masalahnya? Berhasilkah Kamal mewujudkan mimpinya untuk jadi Selebgram? Saksikan film hiburan ini di bioskop kesayangan Anda, 10 Mei 2017.', 'Comedy', 2017, '2017-05-10', 120, 'Wishnu Kuncoro', 'Herri Arissa, Puji Lestari', ' Ria Ricis, Billa Barbie, Arief Didu, Opie Kumis, Aldi Maldini, Syifa Hadju', 'http://www.21cineplex.com/data/gallery/pictures/149179495071313_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/7pzvWzZEIXE\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, NULL, 0, 2),
(119, 'STIP & PENSIL', 'Toni (Ernest Prakasa), Aghi (Ardit Erwandha), Bubu (Tatjana Saphira) dan Saras (Indah Permatasari) adalah anak anak orang kaya yang dimusuhi anak anak di SMU sekolahnya. Karena dibanding yang lain mereka selalu merasa sok jago dan songong.', 'Comedy, Family', 2016, '2016-10-07', 92, 'Steve Carr', 'Chris Bowman (screenplay), Hubbel Palmer (screenplay), Kara Holden (screenplay), James Patterson (based on the book by), Chris Tebbetts (based on the book by)', 'Griffin Gluck, Lauren Graham, Alexa Nisenson, Andrew Daly', 'http://sinopsisfilmbioskopterbaru.com/wp-content/uploads/2017/04/stipdanpensil-poster.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/spIsyTJ0DS8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4981636', 6.1, 51, 9, 2, '', 0, 2),
(120, 'KONG SKULL ISLAND', 'Pada tahun 1970an, sekelompok tim penjelajah dikirim untuk menelusuri sebuah pulau misterius bernama Skull Island yang terletak di samudera Hindia. Mereka segera menyadari ancaman yang terdapat di pulau tersebut sebab Skull Island adalah rumah dari kera raksasa bernama King Kong yang memiliki kekuatan dahsyat dan kecerdasan yang menyerupai manusia.', 'Action, Adventure, Fantasy', 2017, '2017-03-10', 119, 'Jordan Vogt-Roberts', 'Dan Gilroy (screenplay), Max Borenstein (screenplay), John Gatins (story), Dan Gilroy (story), Merian C. Cooper (original story), Edgar Wallace (original story)', 'Tom Hiddleston, Corey Hawkins, Brie Larson, Samuel L. Jackson', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTUwMzI5ODEwNF5BMl5BanBnXkFtZTgwNjAzNjI2MDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/44LdLqgOpjo\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3731562', 0, 0, 7, 20, NULL, 0, 2),
(123, 'DANUR', 'Gadis yang mendapatkan persahabatan dengan 5 hantu.', 'Horror', 2017, '2017-03-30', 78, 'Awi Suryadi', 'N/A', 'Prilly Latuconsina, Shareefa Daanish, Asha Kenyeri Bermudez, Kevin Bzezovski', 'https://images-na.ssl-images-amazon.com/images/M/MV5BYWNlODg3YTMtMTQxNC00NGFkLTk1MGQtMDhiYWU3ZjVjYjM2XkEyXkFqcGdeQXVyMzMzNjk0NTc@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/YLU6Qfi0cDY\" frameborder=\"0\" allowfullscreen></iframe>', 'tt6496236', 6.8, 0, 37, 28, NULL, 0, 2),
(128, 'KING ARTHUR: LEGEND OF SWORD', 'Petualangan Arthur (Charlie Hunnam) bersama teman-temannya membawa dia mengangkat pedang Excalibur yang melegenda.  Kemudian dengan pedang magis Excalibur itu, Arthur bergabung dengan seorang wanita misterius bernama Guinevere.   Ia terus mempelajari kekuatan pedang tersebut untuk bisa', 'Action, Adventure, Drama', 2017, '2017-03-07', 126, 'Guy Ritchie', 'Joby Harold, Guy Ritchie, Lionel Wigram', 'Charlie Hunnam, Jude Law, Djimon Hounsou, Eric Bana', 'http://www.21cineplex.com/data/gallery/pictures/149248561879841_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/6rbPTQIdjmY\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1972591', 7.3, 27, 0, 0, NULL, 0, 2),
(129, 'ALIEN: COVENANT', 'Awak kapal koloni Perjanjian, terikat untuk sebuah planet terpencil di sisi jauh galaksi, menemukan apa yang mereka pikir adalah surga yang belum dipetakan, tapi ini benar-benar gelap, berbahaya di dunia. Ketika mereka menemukan sebuah ancaman di luar imajinasi mereka, mereka harus mencoba melarikan diri mengerikan', 'Sci-Fi, Thriller', 2017, '2017-05-19', 0, 'Ridley Scott', 'John Logan (screenplay), Dante Harper (screenplay), Jack Paglen (story by), Michael Green (story by), Dan O\'Bannon (based on characters created by), Ronald Shusett (', 'Katherine Waterston, Michael Fassbender, James Franco, Noomi Rapace', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNzI5MzM3MzkxNF5BMl5BanBnXkFtZTgwOTkyMjI4MTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/H0VW6sg50Pk\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2316204', 6.9, 71, 0, 0, NULL, 0, 2),
(130, 'AFTERMATH', 'Dua orang asing\' hidup menjadi terikat erat bersama-sama setelah bencana kecelakaan pesawat. Terinspirasi oleh peristiwa-peristiwa aktual, SETELAH bercerita tentang rasa bersalah dan balas dendam setelah pengendali lalu lintas udara (Scoot McNairy) kesalahan yang menyebabkan kematian seorang mandor bangunan (Arnold Schwarzenegger) istri dan putrinya.', 'Drama, Thriller', 2017, '2017-04-07', 92, 'Elliott Lester', 'Javier Gulln', 'Arnold Schwarzenegger, Maggie Grace, Kevin Zegers, Scoot McNairy', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMWFkYmM2ZTctNmZjZi00MWQwLWI0MjctZDdiNjJlMTlmNzdkL2ltYWdlXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/ZN8toxhSn9Y\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4581576', 6, 43, 0, 5, NULL, 0, 2),
(131, 'STIP & PENSIL', 'Toni (Ernest Prakasa), Aghi (Ardit Erwandha), Bubu (Tatjana Saphira) dan Saras (Indah Permatasari) adalah anak anak orang kaya yang dimusuhi anak anak di SMU sekolahnya. Karena dibanding yang lain mereka selalu merasa sok jago dan songong.', 'Comedy, Family', 2016, '2016-10-07', 92, 'Steve Carr', 'Chris Bowman (screenplay), Hubbel Palmer (screenplay), Kara Holden (screenplay), James Patterson (based on the book by), Chris Tebbetts (based on the book by)', 'Griffin Gluck, Lauren Graham, Alexa Nisenson, Andrew Daly', 'http://sinopsisfilmbioskopterbaru.com/wp-content/uploads/2017/04/stipdanpensil-poster.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/spIsyTJ0DS8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4981636', 6.1, 51, 1, 1, '', 0, 2),
(132, 'BEFORE I FALL', 'Februari 12 ini hanya hari lain di Sam terpesona hidup sampai itu ternyata menjadi yang terakhir. Terjebak mengenang hari terakhir nya lebih dari satu bisa dijelaskan minggu, Sam mencegah misteri seputar kematiannya dan menemukan segala sesuatu yang dia dalam bahaya kehilangan.', 'Drama', 2017, '2017-03-03', 91, 'Ry Russo-Young', 'Maria Maggenti (screenplay), Lauren Oliver (based on the novel by)', 'Zoey Deutch, Halston Sage, Logan Miller, Kian Lawley', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNDYwOTY0MDI2OV5BMl5BanBnXkFtZTgwOTE5NzM2MDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/q3Zyy4ZXegE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1691916', 6.5, 58, 0, 0, NULL, 0, 2),
(159, 'COLOSSAL', 'Seorang wanita menemukan bahwa berat peristiwa bencana yang entah bagaimana terhubung dengan gangguan mental dari mana dia menderita.', 'Action, Comedy, Sci-Fi', 2016, '2017-04-21', 110, 'Nacho Vigalondo', 'Nacho Vigalondo', 'Dan Stevens, Anne Hathaway, Jason Sudeikis, Tim Blake Nelson', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY2NTExOTA2MF5BMl5BanBnXkFtZTgwNTMwMjE2MTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/fqcZtz8VXXE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4680182', 6.7, 59, 0, 0, NULL, 0, 1),
(160, 'UNLOCKED', 'CIA interogasi terpikat ke dalam tipu muslihat yang menempatkan London pada risiko serangan biologis.', 'Action, Thriller', 2016, '2016-11-02', 120, 'Michael Apted', 'Peter O\'Brien (screenplay)', 'Noomi Rapace, Toni Collette, Orlando Bloom, Michael Douglas', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjk1NDcwMDkwN15BMl5BanBnXkFtZTgwOTU3NTI0MTI@._V1_SY1000_CR0,0,675,1000_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/CCqISHuTgHE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1734493', 6, 25, 0, 0, NULL, 0, 2),
(165, 'THE CIRCLE', 'Ketika Mae disewa untuk bekerja untuk dunia yang terbesar dan paling kuat teknologi dan perusahaan media sosial, dia melihat itu sebagai sebuah kesempatan seumur hidup. Saat ia naik melalui pangkat, dia didorong oleh pendiri perusahaan, Eamon Bailey, untuk terlibat dalam sebuah terobosan percobaan yang mendorong batas-batas privasi, etika dan akhirnya dia kebebasan pribadi. Partisipasinya dalam percobaan, dan setiap keputusan yang dia mulai mempengaruhi kehidupan dan masa depan dari teman-temannya, keluarga dan umat manusia.', 'Drama, Sci-Fi, Thriller', 2017, '2017-04-28', 110, 'James Ponsoldt', 'James Ponsoldt (screenplay), Dave Eggers (screenplay), Dave Eggers (based on the novel by)', 'Emma Watson, Karen Gillan, Tom Hanks, Bill Paxton', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjY2OTM2Njc3Ml5BMl5BanBnXkFtZTgwNDgzODU3MTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/2C9tKfl8t0Y\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4287320', 0, 0, 0, 0, NULL, 0, 2),
(166, 'STRATTON', 'Inggris Khusus Layanan Perahu komando melacak teroris internasional sel.', 'Action, Thriller', 2017, '2017-03-17', 120, 'Simon West', 'Duncan Falconer (based on the novel by), Warren Davis II (screenplay), Duncan Falconer (screenplay)', 'Connie Nielsen, Gemma Chan, Tyler Hoechlin, Tom Felton', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA3ODA2NDUyOV5BMl5BanBnXkFtZTgwNjc4MzkwOTE@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/bDBPPUWiJOg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3567666', 0, 0, 0, 0, '', 0, 2),
(167, 'MEMBABI BUTA', 'MARIATIN (Prisia Nasution) akhirnya diterima bekerja sebaga asisten rumah tangga dirumah milik dua orang perempuan kakak beradik SUNDARI dan SULASEMI yang berumur sekitar 55-60 tahun an. Mariatin juga membawa serta anaknya Asti untuk tinggal di rumah tersebut. Sundari', 'Action, Thriller', 2017, '2017-05-04', 120, 'Simon West', 'Duncan Falconer (based on the novel by), Warren Davis II (screenplay), Duncan Falconer (screenplay)', 'Connie Nielsen, Gemma Chan, Tyler Hoechlin, Tom Felton', 'http://www.21cineplex.com/data/gallery/pictures/149319172338172_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/XlAb5GX0M6Q\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3567666', 0, 0, 0, 0, NULL, 0, 2),
(169, 'OVERDRIVE', 'Cerita berpusat pada dua pencuri mobil, saudara-saudara, yang melakukan perjalanan ke selatan Perancis untuk peluang baru dan angin di rambut lintas dari bos kejahatan lokal. Andrew dan Garrett Foster (...', 'Action, Thriller', 2017, '2017-05-05', 120, 'Antonio Negret', 'Michael Brandt, Derek Haas', 'Ana de Armas, Scott Eastwood, Gaia Weiss, Clemens Schick', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOGU3MDkyM2MtYWNhMi00YjVhLWE1NmQtMDU5MmMyZjlmYmRlXkEyXkFqcGdeQXVyMTk1MDM0OTc@._V1_SY1000_CR0,0,737,1000_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/kWqAJE-Yshs\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1935194', 0, 0, 0, 0, NULL, 0, 1),
(179, 'THE DISAPPOINTMENTS ROOM', 'Arsitek Dana, suaminya David, dan anak mereka, Lucas pindah ke yang terisolasi manor di pedesaan yang mencari restart kehidupan mereka setelah kematian bayi putri mereka dalam sebuah kecelakaan tragis. Dana sengaja mendengar suara-suara di loteng dan menemukan tersembunyi kamar terkunci. Segera dia menemukan kunci dan dihantui oleh roh-roh jahat dari orang tua. Dia meneliti dan belajar yang lama pedesaan rumah-rumah kekecewaan ruang di mana keluarga dan anak cacat yang terkunci untuk menghindari rasa malu kepada keluarga tradisional. Selanjutnya, roh-roh asli pemilik rumah, Hakim Hitam, dan putrinya yang masih terjebak di dalam rumah. Namun, hanya Dana lebih mampu untuk melihat dan menghubungi mereka dan David percaya dia adalah delusi. Ketika Hakim Hitam mengancam kehidupan Lucas, Dana mencoba untuk melindungi dia tapi dia tidak yakin apa yang merupakan kenyataan atau melamun.', 'Drama, Horror, Thriller', 2016, '2016-09-09', 85, 'D.J. Caruso', 'D.J. Caruso, Wentworth Miller (screenplay)', 'Kate Beckinsale, Mel Raido, Duncan Joiner, Lucas Till', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTE0MTE3MzI4ODFeQTJeQWpwZ15BbWU4MDI1MDI0ODkx._V1_SX300.jpg', NULL, 'tt2364897', 3.9, 31, 0, 0, NULL, 0, 2),
(180, 'GUARDIANS OF THE GALAXY VOL. 2', 'Setelah menyelamatkan Xandar dari murka Ronan, para Wali kini dikenal sebagai pahlawan. Sekarang tim harus membantu pemimpin mereka Star Lord (Chris Pratt) mengungkap kebenaran di balik warisan sejatinya. Sepanjang jalan, musuh lama beralih ke sekutu dan pengkhianatan sedang mekar. Dan Wali menemukan bahwa mereka melawan ancaman baru yang menghancurkan yang menguasai galaksi tersebut.', 'Action, Adventure, Sci-Fi ', 2017, '2017-05-05', 136, 'James Gunn', 'James Gunn, Dan Abnett (based on the Marvel comics by) ', 'Chris Pratt, Zoe Saldana, Dave Bautista', 'https://media0dk-a.akamaihd.net/56/44/9309ee7890499a5b4d7d825f02dbe80e.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/2cv2ueYnKjg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3896198', 8.1, 67, 0, 0, 'GUARDIANS OF THE GALAXY VOL. 2, GOTG2, GOTG 2, GUARDIANS2, GUARDIAN 2, GALAXY 2, GALAXY2', 0, 2),
(181, 'MY NEIGHBOR TOTORO', 'Ketika dua anak perempuan pindah ke negara tersebut untuk berada di dekat ibu mereka yang sakit, mereka memiliki petualangan dengan roh-roh hutan yang menakjubkan yang tinggal di dekatnya.', 'Animation, Family, Fantasy ', 1988, '1988-04-16', 86, 'Hayao Miyazaki', 'Hayao Miyazaki', 'Hitoshi Takagi, Noriko Hidaka, Chika Sakamoto ', 'http://www.21cineplex.com/data/gallery/pictures/149356464553183_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/B6B_nuHksvs\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0096283', 8.2, 0, 0, 0, 'My Neighbor Totoro, totoro, totoro 2016, totoro 2k16, anime totoro', 0, 2),
(183, 'ZIARAH', 'Mbah Sri (95 tahun) berusaha mencari makam suaminya, setelah ia menghilang selama puluhan tahun untuk satu tujuan. Mbah Sri ingin dimakamkan di samping makam suaminya', 'Drama', 2017, '2017-05-24', 87, 'BW Purba Negara', 'BW Purba Negara', 'Ponco Sutiyem, Rukman Rosadi, Ledjar Subroto, Vera Prifatamasari', 'http://www.21cineplex.com/data/gallery/pictures/149387115281873_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/GZ6VyAoy0Eg\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, NULL, 0, 2),
(184, 'PIRATES OF THE CARIBBEAN: SALAZAR\'S REVENGE', 'Petualangan menyenangkan kini tak lagi berpihak pada Kapten Jack Sparrow (Johnny Depp). Pada seri ke 5 Pirates of the Caribbean ini Jack harus melawan musuh bebuyutannya Kapten Salazar (Javier Bardem) untuk menyelamatkan hidupnya.', ' Action, Adventure, Fantasy', 2017, '2017-05-26', 129, 'Joachim Rnning, Espen Sandberg', ' Jeff Nathanson (screenplay), Jeff Nathanson (story by)', ' Johnny Depp, Geoffrey Rush, Javier Bardem', 'http://www.21cineplex.com/data/gallery/pictures/149395070778887_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/lsJ58L3u8qw\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1790809', 7, 39, 0, 0, 'PIRATES OF THE CARIBBEAN, SALAZAR\'S REVENGE, SALAZARS REVENGE, SALAZAR REVENGE, REVENGE SALAZAR, Dead Men Tell No Tales, PIRATES2017, PIRATES2K17, PIRATES 2017, PIRATES 2K17', 0, 2),
(186, 'THE AUTOPSY OF JANE DOE', 'Cox dan Hirsch bermain ayah dan anak koroner yang menerima misterius korban pembunuhan dengan tidak jelas penyebab kematian. Karena mereka berusaha untuk mengidentifikasi muda yang cantik \"Jane Doe,\" mereka menemukan semakin aneh petunjuk yang memegang kunci rahasia menakutkan.', 'Horror, Mystery', 2016, '2016-12-21', 86, 'Andr vredal', 'Ian B. Goldberg, Richard Naing', 'Brian Cox, Emile Hirsch, Ophelia Lovibond, Michael McElhatton', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA2MTEzMzkzM15BMl5BanBnXkFtZTgwMjM2MTM5MDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/mtTAhXuiRTc\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3289956', 6.8, 64, 0, 0, NULL, 0, 2),
(188, 'FILOSOFI KOPI 2: BEN & JODY', 'Diangkat dari dua karakter dalam cerita pendek \"Filosofi Kopi\" karya Dee Lestari, Filosofi Kopi 2: Ben & Jody berkisah tentang perjalanan 2 tahun setelah Ben (Chicco Jerikho) dan Jody (Rio Dewanto) memutuskan untuk menjual kedai mereka dan berkeliling Indonesia demi membagikan \"kopi terbaik\". Petualangan seru Ben dan Jody bersama Kombi Filosofi Kopi pun menemui jalan buntu. Puncaknya terjadi di suatu malam di Bali, saat Aga, Aldi dan Nana memutuskan mengundurkan diri dengan alasan mereka masing-masing.  Ben dan Jody pun kini harus membuat mimpi baru; pulang ke Jakarta dan menjadi kedai kopi nomor satu. Lagi. Mimpi yang tidak mudah karena Ben yang idealis selalu membuat Jody jengah dan sadar selalu berada di bawah bayang  bayang Ben. Dalam usaha mereka, Ben & Jody dipertemukan dengan 2 perempuan, seorang investor bernama Tarra (Luna Maya) dan barista geek bernama Brie (Nadine Alexandra). Pertemuan yang membawa Ben dan Jody pada pertaruhan akan persahabatan mereka  Saksikan perjalanan Ben dan Jody di bioskop mulai tanggal 13 Juli 2017.', 'Drama', 2017, '2017-07-13', 120, 'Angga Dwimas Sasongko', 'Jenny Jusuf, Irfan Ramly, Angga Dwimas Sasongko', 'Tio Pakusadewo, Joko Anwar, Whani Darmawan, Chicco Jerikho, Rio Dewanto, Luna Maya, Nadine Alexandra', 'https://pbs.twimg.com/media/DCbceNtU0AI69uh.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/4b56apex1AA\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 8, 0, 'FILOSOFI KOPI 2,#FILOSOFIKOPI2:BEN&JODY,FILOSOFI KOPI 2: BEN & JODY', 0, 2),
(189, 'WONDER WOMAN', 'Sebelum dia bertanya-Tanya Wanita itu, dia adalah Diana, putri dari Amazon, dilatih untuk menjadi seorang prajurit tak terkalahkan. Dibesarkan di sebuah pulau terlindung surga, ketika seorang pilot Amerika crash di pantai mereka dan menceritakan tentang sebuah konflik besar yang berkecamuk di dunia luar, Diana meninggalkan rumahnya, yakin dia bisa menghentikan ancaman. Berjuang bersama pria dalam perang untuk mengakhiri semua perang, Diana akan menemukan-nya yang penuh kekuasaan dan takdir.', 'Action, Adventure, Fantasy', 2017, '2017-06-02', 141, 'Patty Jenkins', 'Allan Heinberg (screenplay), Zack Snyder (story by), Allan Heinberg (story by), Jason Fuchs (story by), William Moulton Marston (Wonder Woman created by)', 'Gal Gadot, David Thewlis, Robin Wright, Chris Pine', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNDFmZjgyMTEtYTk5MC00NmY0LWJhZjktOWY2MzI5YjkzODNlXkEyXkFqcGdeQXVyMDA4NzMyOA@@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/VSB4wGIdDwo\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0451279', 0, 0, 0, 0, NULL, 0, 2),
(190, 'MULTIVERSE: THE 13TH STEP', 'Farrrel dan keluarganya baru saja pindah rumah. Setelah beberapa lama menempati rumah tersebut, Farrel mendapatkan pesan singkat dari seorang gadis bernama Nadia. Hanya dengan menggunakan ponsel, hubungan mereka semakin lama semakin dekat dan mampu membuat Farrel jatuh cinta', 'Action, Adventure, Fantasy', 2017, '2017-06-02', 141, 'Patty Jenkins', 'Allan Heinberg (screenplay), Zack Snyder (story by), Allan Heinberg (story by), Jason Fuchs (story by), William Moulton Marston (Wonder Woman created by)', 'Gal Gadot, David Thewlis, Robin Wright, Chris Pine', 'http://www.21cineplex.com/data/gallery/pictures/149430216981332_300x430.jpg', NULL, 'tt0451279', 0, 0, 0, 0, NULL, 0, 2),
(191, 'UNFORGETTABLE', 'Seorang wanita menetapkan untuk membuat neraka hidup untuk mantan suaminya istri baru.', 'Drama, Thriller', 2017, '2017-04-21', 100, 'Denise Di Novi', 'Christina Hodson, David Leslie Johnson (screenplay)', 'Rosario Dawson, Katherine Heigl, Geoff Stults, Cheryl Ladd', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjAxNDMyMzIzMl5BMl5BanBnXkFtZTgwNTczODY2MTI@._V1_SX300.jpg', NULL, 'tt3462710', 5.3, 44, 0, 0, NULL, 0, 2),
(193, 'THE MUMMY', 'Sepasang suami istri, Nick Morton (Tom Cruise) dan Jenny Halsey (Annabelle Wallis) melakukan penelitian di sebuah gurun di Afrika. Mereka kemudian menemukan sarkofagus yang belakangan diketahui berisi mummy dari ratu Mesir kuno bernama Ahmanet.\r\n\r\nRatu Mesir Ahmanet (Sofia Boutella) terbangun membawa kebencian dan kemarahan karena dikhianati semasa hidupnya. Ia kemudian melakukan teror yang menentang pemahaman manusia.', 'Action, Adventure, Fantasy', 2017, '2017-06-09', 120, 'Alex Kurtzman', 'Jon Spaihts, Christopher McQuarrie', 'Sofia Boutella, Tom Cruise, Annabelle Wallis, Russell Crowe', 'http://www.21cineplex.com/data/gallery/pictures/149510501840833_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/IjHgzkQM2Sg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2345759', 0, 0, 0, 0, NULL, 0, 2),
(194, 'INSYA ALLAH SAH', 'Ketika datang ke kantor Dion, tunangannya, Silvi ,seorang gadis cantik yang baik hati tapi tidak religius terjebak dalam lift dengan Raka, pemuda religius, lugu dan terkesan aneh, yang bekerja untuk Dion. \r\n\r\nTakut kalau ini akan menjadi akhir hidupnya, Silvi bernazar, apabila selamat, ia akan merubah hidupnya, menjadi seorang wanita muslimah yang taat pada perintah Allah. Ternyata, sedetik setelah ia mengucapkan itu, pintu lift tiba-tiba terbuka. \r\n\r\nSejak itu Silvi selalu dibayangi Raka yang selalu mengingatkan janji Silvi di Lift. Dan setelah beberapa musibah tiba-tiba menyerang Silvi, Raka-lah yang akhirnya menolongnya sampai Silvi menemukan ketetapan hatinya. Namun belum tentu Dion setuju dengan nazar Silvi.', 'Action, Adventure, Fantasy', 2017, '2017-06-09', 120, 'Alex Kurtzman', 'Jon Spaihts, Christopher McQuarrie', 'Sofia Boutella, Tom Cruise, Annabelle Wallis, Russell Crowe', 'http://www.21cineplex.com/data/gallery/pictures/149500678930877_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/2Cg1e1xGuUk\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2345759', 0, 0, 0, 0, NULL, 0, 2),
(195, 'MANTAN', 'Seorang kolumnis majalah percintaan bernama Adi (Gandhi Fernando) yang sudah bertunangan, tapi pergi mengunjungi lima mantan pacarnya sebelum menikah; Ella (Ayudia Bing Slamet) di Bandung, Frida (Karina Nadila) di Yogyakarta, Juliana (Kimberly Ryder) di Bali, Tara (Luna Maya) di Medan, dan Deedee (Citra Scholastika) di Jakarta. Apakah pertemuan dengan mereka cukup untuk Adi benar-benar yakin menikahi tunangannya? Adakah salah satu dari mereka yang ternyata sebenarnya soulmate-nya, tetapi dulu putus karena waktu yang tidak tepat? Atau adakah tujuan lain di balik ini semua?', 'Drama, Romance', 2017, '2017-04-01', 120, 'Svetlana Dea', 'Gandhi Fernando, Eka D. Sitorus', 'Gandhi Fernando, Luna Maya, Citra Scholastika, Kimberly Ryder', 'http://www.21cineplex.com/data/gallery/pictures/149499013683407_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/izTTicjjkdw\" frameborder=\"0\" allowfullscreen></iframe>', 'tt6177350', 0, 0, 0, 0, NULL, 0, 2),
(196, 'SURAT KECIL UNTUK TUHAN', 'Kisah pilu tentang kehidupan kakak beradik yatim piatu, Anton (Bima Azriel) dan Angel (Izzati Khansa). Dimana keduanya terjebak dalam suatu sindikat yang memanfaatkan anak-anak terlantar untuk menjadi pengemis jalanan. Di usia mereka yang masih sangat kecil, mereka diperbudak untuk menjadi mesin uang tanpa kenal waktu. Keduanya tidak pernah mengenal indahnya masa kecil. Hingga satu peristiwa Angel mengalami kecelakaan di jalan raya. Ketika Angel sadar, ia sudah ditinggalkan seorang diri di rumah sakit. Dan sejak saat itulah Angel terpisahkan dengan Anton. Ia tidak pernah tahu lagi dimana keberadaan Abangnya..\r\n\r\n15 tahun berlalu, di Sydney, Australia. Berkat keluarga angkatnya yang baik hati, Angel (Bunga Citra Lestari) tumbuh menjadi perempuan cantik dan pandai. Ia berhasil mewujudkan mimpinya menjadi seorang Pengacara. Disana Angel bertemu dengan Martin (Joe Taslim) seorang dokter muda asal Indonesia yang baik hati dan membuatnya jatuh cinta. Hidupnya kini diliputi kebahagiaan. Tapi meski demikian Angel tetap dihantui oleh masa lalunya. Ia tidak pernah bisa berhenti memikirkan Anton. Ditengah hidupnya yang penuh kebahagiaan dan rencananya untuk menikah dengan Martin, Angel mengambil keputusan untuk kembali ke Jakarta untuk menyelesaikan dulu masa lalunya, mencari keberadaan sang Abang.\r\n\r\nAkankah Angel dan Anton bisa bertemu lagi setelah 15 tahun terpisah?', 'Drama', 2017, '2017-08-01', 110, 'Fajar Bustomi', 'Upi Avianto', 'Bunga Citra Lestari, Joe Taslim, Lukman Sardi, Aura Kasih', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNzM1Zjc1OGMtM2ZjMy00ZDlhLWI1NmQtZGQxYjFiYTZkNGQ1XkEyXkFqcGdeQXVyNjcyODMyNTM@._V1_UY1200_CR105,0,630,1200_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/pdYfAG6Hvk8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt6825826', 0, 0, 101, 76, '', 0, 2),
(197, 'SPIDER-MAN: HOMECOMING', 'Peter Parker (Tom Hollander) menemukan jati dirinya sebagai seorang superhero ketika ia masih remaja.\r\n\r\nUntuk dapat menguasai kemampuan superheronya menjadi jauh lebih hebat, ia dibimbing salah satu anggota Avengers, Tony Stark (Robert Downey).\r\n\r\nNamun di tengah usahanya tersebut, tiba-tiba ia dihadapkan dengan kebimbangan antara melakukan rutinitas normalnya atau menyelamatkan dunia.', 'Action, Adventure', 2017, '2017-07-07', 120, 'Jon Watts', 'Jonathan Goldstein, John Francis Daley, Jon Watts, Christopher Ford, Chris Mckenna, Erik Sommers', 'Tom Holland, Marisa Tomei, Robert Downey Jr.', 'https://cdn.vox-cdn.com/uploads/chorus_asset/file/8571017/spider_man_poster.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/Fbfe3dH4LDs\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2250912', 0, 0, 40, 10, 'spiderman homecoming, homecoming spiderman, spider-man homecoming, homecoming spider-man', 9, 2),
(198, 'TRANSFORMERS: THE LAST KNIGHT', 'Di seri kelima Transformers ini, Optimus Prime menemukan kembali planet asalnya yang sekarang merupakan planet mati, Cybertron.\r\n\r\nDia menemukan cara untuk menghidupkan kembali planet ini, tapi untuk melakukannya dia perlu menemukan sebuah artefak yang ada di Bumi.', 'Action, Adventure, Sci-fi', 2017, '2017-06-22', 120, 'Michael Bay', 'Matt Holloway, Art Marcum, Ken Nolan', 'Mark Wahlberg, Josh Duhamel, Laura Haddock, Isabela Moner', 'https://i0.wp.com/media2.slashfilm.com/slashfilm/wp/wp-content/images/transformers-lastknight-awfulposter-full-700x993.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/AntcyqJ6brc\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3371366', 0, 0, 19, 18, 'TRANSFORMERS THE LAST KNIGHT, TRANSFORMERS LAST KNIGHT, TRANSFORMER THE LAST KNIGHT, TRANSFORMER LAST KNIGHT, TRANSFORMERS 4, TRANSFORMERS4, TRANSFORMER4, TRANSFORMER 4', 0, 2),
(199, 'THE DOLL 2', 'Maira dan Aldo hidup berbahagia dengan Kayla, anak mereka yang masih kecil dan juga Yani, pembantu mereka. Sebuah kecelakaan tragis merenggut nyawa Kayla dan membuat kebahagian mereka hilang.\r\n\r\nTetapi 6 bulan kemudian, tepat di hari ulang tahun Kayla berikutnya, Maira mulai merasakan bahwa ia tidak sendirian. Maira merasa bahwa Kayla masih belum benar-benar pergi.\r\n\r\nAtas saran Elsa, sahabatnya, Maira mencoba untuk berkomunikasi kepada Kayla dengan mengunakan medium boneka Sabrina, boneka kesayangan Kayla. Sejak itu Maira mulai merasa terganggu dan meyakini bahwa Kayla yang mengganggunya. Aldo tidak percaya padanya. Tapi Maira yakin Kayla sekarang berada dalam boneka Sabrina dan ia ingin menyampaikan sesuatu kepada Maira.', 'Horror', 2017, '2017-07-08', 120, 'Rocky Soraya', 'Rocky Soraya', 'Luna Maya, Sara Wijayanto, Rydhen Afexi, Maria Sabta, Mega Caferansa, Herjunot Ali, Herjunot Ali', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMGFhZjY1YWItNjdiOC00ZDFmLWJlNGYtYjU4NDdiYTA1YTMyXkEyXkFqcGdeQXVyMzYzOTYxNzM@._V1_UY268_CR9,0,182,268_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/xrOXM5cCgFI\" frameborder=\"0\" allowfullscreen></iframe>', '#THEDOLL2,TH', 0, 0, 0, 0, '#THEDOLL2,THE DOLL 2', 0, 2);
INSERT INTO `film` (`id`, `title`, `summary`, `genre`, `year`, `playing_date`, `length`, `director`, `writer`, `actors`, `poster`, `trailer`, `imdb_id`, `imdb_rating`, `metascore`, `twitter_positif`, `twitter_negatif`, `twitter_search`, `rating`, `status`) VALUES
(205, 'THE LOST CITY OF Z', 'Kota Hilang Z menceritakan kisah nyata yang luar biasa dari penjelajah Inggris Percy Fawcett, yang melakukan perjalanan ke Amazon pada awal abad ke-20 dan menemukan bukti adanya peradaban maju yang sebelumnya tidak diketahui yang mungkin pernah menghuni wilayah ini. Meskipun diejek oleh pendirian ilmiah yang menganggap penduduk pribumi sebagai \"orang liar,\" Fawcett yang ditentukan - didukung oleh istrinya yang setia, anak laki-laki dan ajudan kamp kembali berkali-kali ke hutan kesayangannya untuk membuktikan kasusnya, yang berpuncak padanya. Menghilang secara misterius di tahun 1925.', 'Action, Adventure, Biography ', 2017, '2017-04-21', 141, 'James Gray', 'James Gray (written for the screen by), David Grann (based on the book by)', 'Charlie Hunnam, Robert Pattinson, Sienna Miller', 'https://www.mauvais-genres.com/19533/the-lost-city-of-z-movie-poster-47x63-in-2017-james-gray-robert-pattinson.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/wwjtdOqTmrA\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1212428', 6.9, 78, 0, 0, 'THE LOST CITY OF Z, CITY Z', 0, 2),
(206, 'THE WHOLE TRUTH', 'Richard Ramsay (Keanu Reeves) seorang pengacara kondang, mendapatkan kasus dari kliennya remaja 17 tahun bernama Mike Lassiter (Gabriel Basso). Mike dituduh sebagai pembunuh dalam kasus kematian ayahnya Boone Lassiter (Jim Belushi) yang kaya raya. ', 'Crime, Drama, Mystery ', 2016, '2016-10-21', 93, 'Courtney Hunt', 'Nicholas Kazan (as Rafael Jackson)', 'Keanu Reeves, Rene Zellweger, Gugu Mbatha-Raw', 'https://www.assignmentx.com/wp-content/uploads/2016/10/THE-WHOLE-TRUTH-movie-poster1.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/eNjXFdiC1O0\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3503406', 6.1, 46, 0, 0, '', 0, 2),
(207, 'A FAMILY MAN', 'Sebagai bos (Willem Dafoe) dari headhunter yang berbasis di Chicago, Dane Jensen (Gerard Butler), yang bekerja di agen Rekrutmen Blackrock yang mengatur pekerjaan untuk insinyur, bersiap untuk pensiun, Jensen ingin meraih tujuan lama untuk mengambil alih perusahaan tersebut. Head-to-head dengan saingan ambisiusnya, Lynn Vogel (Alison Brie). Namun, anak laki-laki berusia 10 tahun Dane, Ryan (Max Jenkins), tiba-tiba didiagnosis menderita kanker dan prioritas profesionalnya di tempat kerja dan prioritas pribadi di rumah mulai berbenturan satu sama lain.', 'Drama ', 2017, '2017-07-28', 108, 'Mark Williams', 'Bill Dubuque', 'Alison Brie, Gerard Butler, Willem Dafoe ', 'https://images-na.ssl-images-amazon.com/images/M/MV5BYjdkY2MzMGEtNzI5YS00ZDVkLTliZmMtZGMxZDJiMGU2MjIwXkEyXkFqcGdeQXVyMTExNDQ2MTI@._V1_UX182_CR0,0,182,268_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/zH50qtIyxiI\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1718924', 6.4, 0, 0, 0, 'A FAMILY MAN, FAMILY MAN', 0, 2),
(208, '47 METERS DOWN', 'Dua saudara perempuan yang berlibur di Meksiko terjebak dalam kandang ikan hiu di dasar samudra. Dengan kurang dari satu jam oksigen keluar dan hiu putih besar berputar-putar di dekatnya, mereka harus berjuang untuk bertahan hidup.', 'Adventure, Drama, Horror ', 2017, '2017-06-16', 89, 'Johannes Roberts', 'Johannes Roberts, Ernest Riera', 'Mandy Moore, Claire Holt, Matthew Modine', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOGJlNDJkZmEtMjUwNS00ZWViLWIyZGEtN2Y5ZjZlNDE1NWJkXkEyXkFqcGdeQXVyNDg2MjUxNjM@._V1_UX182_CR0,0,182,268_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/ddYSGGJAKOk\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2932536', 6, 53, 67, 38, '47 METERS DOWN, 47 METERS, 47M', 0, 2),
(211, 'TEN', 'Sepuluh wanita menemukan diri mereka berada di sebuah rumah kosong di Pulau Spektor pada bulan Desember 1972. Masing-masing percaya bahwa dia pergi ke rumah untuk urusan bisnis, tapi mereka semua setuju bahwa ada sesuatu yang aneh. Untuk satu hal, seluruh rumah penuh dengan gambar dan patung babi. Para wanita semua berasal dari kehidupan yang berbeda secara drastis. Tak satu pun dari mereka akan memilih untuk menghabiskan malam bersama di tempat yang mengerikan, tapi feri terakhir untuk daratan baru saja berlalu, dan badai yang mengerikan sedang bergulir. Mencoba membuat situasi yang tidak menyenangkan, mereka menyerang rumah itu. Gudang anggur dan mengadakan pesta. Seiring malam merayap, bagaimanapun, menjadi jelas bahwa seseorang - atau sesuatu - telah berbohong untuk mendapatkannya di rumah. Tidak lama kemudian seseorang menyebutkan bahwa Pulau Spektor seharusnya dihantui. Tentu saja, tidak ada orang di rumah yang percaya akan hantu. Paling tidak, tidak sampai pembunuhan pertama.', 'Adventure, Horror, Mystery', 2014, '2014-01-01', 83, 'Sophia Cacciola, Michael J. Epstein', 'Michael J. Epstein, Sarah Wait Zaranek ', 'Jade Sylvan, Molly Carlisle, Molly Devon ', 'https://zeitgeistfilms.com/image/film/type/poster/id/89/class/full', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/OkD0d8dSgvo\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2496400', 5.8, 0, 0, 0, '#TEN,TEN', 0, 2),
(212, 'KIDNAP', 'Seorang ibu tidak akan berhenti untuk mengembalikan anaknya yang diculik.', 'Thriller ', 2017, '2017-08-04', 94, 'Luis Prieto', 'Knate Lee (screenplay) ', 'Halle Berry, Sage Correa, Dana Gourrier ', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTcyNDgyODEzOV5BMl5BanBnXkFtZTgwMTI4MTA2MjI@._V1_UY1200_CR90,0,630,1200_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/R-Ht8VRPRvU\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1458169', 6.1, 0, 0, 0, 'KIDNAP', 0, 1),
(213, 'VALERIAN AND THE CITY OF A THOUSAND PLANETS', 'VALERIAN DAN KOTA RENCANA RIBUAN adalah film petualangan baru dari Luc Besson, direktur The Professional, The Fifth Element dan Lucy, yang didasarkan pada rangkaian buku komik yang mengilhami generasi seniman, penulis dan pembuat film. Pada abad ke-28, Valerian (Dane DeHaan) dan Laureline (Cara Delevingne) adalah tim operator khusus yang bertugas menjaga ketertiban di seluruh wilayah manusia. Di bawah tugas dari Menteri Pertahanan, keduanya memulai sebuah misi ke kota Alpha yang menakjubkan - sebuah kota metropolitan yang terus berkembang dimana spesies dari seluruh jagat raya berkumpul selama berabad-abad untuk berbagi pengetahuan, kecerdasan dan budaya satu sama lain. Ada misteri di pusat Alpha, sebuah kekuatan gelap yang mengancam keberadaan Kota Ribuan Planet yang damai, dan Valerian dan Laureline harus berlomba untuk mengidentifikasi ancaman dan keamanan yang tidak adil, bukan hanya Alfa, tapi juga masa depan alam semesta.', 'Action, Adventure, Sci-Fi ', 2017, '2017-07-21', 137, 'Luc Besson', 'Pierre Christin (comic book), Jean-Claude Mzires (comic book)', 'Dane DeHaan, Cara Delevingne, Clive Owen ', 'https://i0.wp.com/teaser-trailer.com/wp-content/uploads/Valerian-2.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/W3aOg6_7cEc\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2239822', 0, 0, 0, 0, 'VALERIAN AND THE CITY OF A THOUSAND PLANETS, VALERIAN, CITY OF A THOUSAND PLANETS', 0, 2),
(214, 'WISH UPON', 'Seorang gadis remaja menemukan kotak ajaib yang akan memberinya tujuh keinginan. Karena dia menggunakan keinginannya untuk keuntungan pribadi, hal buruk mulai terjadi pada orang di sekitarnya. Dia menemukan entitas jahat tinggal di dalam kotak dan mungkin berada di balik kematian mengerikan', 'Fantasy, Horror, Thriller ', 2017, '2017-07-14', 90, 'John R. Leonetti', 'Barbara Marshall', 'Sherilyn Fenn, Joey King, Elisabeth Rhm', 'https://i1.wp.com/teaser-trailer.com/wp-content/uploads/Wish-Upon-new-poster.jpg?ssl=1', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/VZjBpt5mCCA\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5322012', 0, 0, 0, 0, 'WISH UPON', 0, 2),
(215, 'STANDOFF', 'Carter (Thomas Jane), seorang veteran bermasalah, mendapat kesempatan untuk melakukan penebusan dengan melindungi seorang gadis berusia 12 tahun dari seorang pembunuh (Laurence Fishburne) setelah dia menyaksikan sebuah pembunuhan. Memegang senapan dengan cangkang tunggal, dia terlibat dalam perang fisik dan psikologis dalam pertarungan putus asa untuk kehidupan gadis itu.', 'Drama, Thriller', 2016, '2016-02-26', 80, 'Adam Alleca', 'Adam Alleca', 'Thomas Jane, Laurence Fishburne, Ella Ballentine', 'https://i0.wp.com/teaser-trailer.com/wp-content/uploads/Standoff-Poster.jpg?', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/-DosgO9X5k0\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3703908', 6, 36, 0, 0, 'STANDOFF', 0, 2),
(216, 'PONYO ON THE CLIFF BY THE SEA           ', 'Putra seorang pelaut, Sosuke yang berusia 5 tahun hidup dengan tenang di tebing lautan dengan ibunya Lisa. Suatu hari yang menentukan, dia menemukan ikan mas yang cantik terperangkap dalam botol di pantai dan saat menyelamatkannya, menamai Ponyo-nya. Tapi dia bukan ikan mas biasa. Putri penyihir ahli dan dewi laut, Ponyo menggunakan sihir ayahnya untuk mengubah dirinya menjadi seorang gadis muda dan dengan cepat jatuh cinta pada Sosuke, namun penggunaan sihir yang begitu kuat ini menyebabkan ketidakseimbangan yang berbahaya di dunia. Saat bulan terus mendekat ke bumi dan ayah Ponyo mengirimkan ombak besar samudera untuk menemukan putrinya, kedua anak tersebut memulai sebuah petualangan seumur hidup untuk menyelamatkan dunia dan memenuhi impian Ponyo untuk menjadi manusia.', 'Animation, Adventure, Comedy ', 2009, '2009-08-14', 101, 'Hayao Miyazaki', 'Hayao Miyazaki', 'Cate Blanchett, Matt Damon, Liam Neeson ', 'https://images-na.ssl-images-amazon.com/images/I/41V-zrzUsML.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/CsR3KVgBzSM\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0876563', 7.7, 86, 0, 0, 'PONYO, ANIME PONYO', 0, 2),
(217, 'SPOOKS: THE GREATER GOOD', 'Personel MI5 terjebak dalam kemacetan di London saat mengawal teroris CIA yang paling dicari ke sebuah tempat penyerahan CIA yang diatur, saat dia tiba-tiba diselamatkan oleh orang-orang bersenjata dengan sepeda motor. Harry Pearce, kepala Counter-Terrorism at MI5 disalahkan karena teroris melarikan diri. Terutama saat Harry menghilang tak lama setelah kejadian itu. Seorang mantan agen, Will Holloway, dan anak didik Harry dipanggil oleh MI5 untuk membantu menemukan dan membawa Harry masuk. Namun Harry telah menghilang karena suatu alasan. Pastinya ada pengkhianat di posisi senior di MI5, dia membesarkan Will yang agak enggan untuk membantunya dalam mengungkap tikus atau tikus yang bersangkutan.', ' Action, Drama, Thriller ', 2015, '2015-12-04', 104, 'Bharat Nalluri', ' Jonathan Brackley (screenplay), Sam Vincent (screenplay)', 'Kit Harington, Peter Firth, Jennifer Ehle', 'https://i.pinimg.com/originals/13/4a/af/134aafe0710f114c235218e347b3c104.png', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/6_A4dzYgxX8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3321300', 6.2, 47, 53, 65, 'SPOOKS: THE GREATER GOOD, SPOOKS THE GREATER GOOD, SPOOKS, MI-5, MI5', 0, 2),
(218, 'DUNKIRK', 'Evakuasi tentara Sekutu dari Belgia, Kekaisaran Inggris, Kanada, dan Prancis, yang terputus dan dikelilingi oleh tentara Jerman dari pantai dan pelabuhan Dunkirk, Prancis, antara 26 Mei - 04 Juni 1940, selama Pertempuran Prancis di Perang dunia II.', 'Action, Drama, History ', 2017, '2017-07-21', 107, 'Christopher Nolan', 'Christopher Nolan', 'Tom Hardy, Cillian Murphy, Kenneth Branagh ', 'https://cdn.flickeringmyth.com/wp-content/uploads/2017/06/dunkirk-poster-600x889.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/F-eMt3SrfFU\" frameborder=\"0\" allowfullscreen></iframe>', 'tt5013056', 0, 0, 20, 5, 'DUNKIRK', 0, 1),
(219, 'DESPICABLE ME 3', 'Setelah dipecat dari Liga Anti-Villain karena gagal menjatuhkan orang jahat terakhir untuk mengancam kemanusiaan, Gru mendapati dirinya berada di tengah krisis identitas utama. Tapi ketika seorang misterius muncul untuk memberi tahu Gru bahwa dia memiliki saudara kembar yang telah lama hilang - seorang saudara laki-laki yang sangat ingin mengikuti jejak kembarannya yang tercengang - seorang mantan penjahat super akan menemukan kembali betapa baiknya rasanya buruk.', 'Animation, Action, Adventure ', 2017, '2017-06-30', 90, 'Kyle Balda, Pierre Coffin', 'Cinco Paul, Ken Daurio', 'Steve Carell, Kristen Wiig, Trey Parker ', 'https://movies.universalpictures.com/media/dm3-adv1sheet-rgb-5-58c818a68f809-1.png', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/euz-KBBfAAo\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3469046', 6.5, 48, 26, 26, '#DESPICABLEME3,DESPICABLE ME 3, DESPICABLE 3, DESPICABLE3', 0, 2),
(220, 'THE CRUCIFIXION', 'Ketika Nicole berhubungan dengan Pastor Anton (Corneliu Ulici), semakin banyak lagi peristiwa yang tak dapat dijelaskan terjadi. Pasangan ini mulai mereka juga percaya bahwa imam kehilangan pertempuran dengan setan.', 'Horror, Mystery, Thriller ', 2017, '2017-08-08', 120, 'Xavier Gens', 'Chad Hayes, Carey Hayes', 'Sophie Cookson, Corneliu Ulici, Brittany Ashworth', 'https://i.pinimg.com/originals/9a/ca/25/9aca258dfca3d861636d55f8a0b1a2c6.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/9J33S2HC8xA\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4181782', 6.6, 0, 0, 0, 'THE CRUCIFIXION', 0, 2),
(221, 'JAGGA JASOOS', 'Bergabunglah dengan Jagga, seorang detektif remaja berbakat, yang bersama dengan teman wanita, sedang mencari ayah yang hilang.', 'Action, Adventure, Comedy ', 2017, '2017-07-14', 180, 'Anurag Basu', 'Anurag Basu', 'Katrina Kaif, Ranbir Kapoor, Sanjay Dutt ', 'http://i.ndtvimg.com/i/2016-12/jagga-jasoos-poster_650x950_81482151534.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/xtm48kJwL1I\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4129428', 0, 0, 0, 0, 'JAGGA JASOOS', 0, 2),
(222, 'WAR FOR THE PLANET OF THE APES', 'Caesar dan kera-kera tersebut dipaksa melakukan konflik mematikan dengan serombongan manusia yang dipimpin oleh Kolonel yang kejam. Setelah kera menderita kerugian yang tak terbayangkan, Caesar bergumul dengan naluri yang lebih gelap dan memulai pencarian mitosnya sendiri untuk membalas suaranya. Seiring perjalanan akhirnya membawa mereka bertatap muka, Caesar dan Kolonel diadu satu sama lain dalam sebuah pertempuran epik yang akan menentukan nasib spesies mereka dan masa depan planet ini.', 'Action, Adventure, Drama ', 2017, '2017-07-14', 140, 'Matt Reeves', 'Mark Bomback, Rick Jaffa (based on characters created by)', 'Toby Kebbell, Andy Serkis, Judy Greer ', 'https://i0.wp.com/media2.slashfilm.com/slashfilm/wp/wp-content/images/war-for-the-planet-of-the-apes-poster.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/X5lWpxvrd-I\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3450958', 0, 78, 0, 0, 'WAR FOR THE PLANET OF THE APES, WAR APES, PLANET APES', 0, 2),
