(239, 'BAYWATCH', 'Dikhususkan lifeguard Mitch Buchannon puntung kepala dengan kurang ajar baru kurir uno sistem, karena mereka mengungkap plot kriminal yang benarkah demokrasi mulai dikebiri masa depan bay.', 'Action / Comedy / Drama', 2017, '2017-05-25', 116, 'Seth Gordon', 'Michael Berk / Douglas Schwartz', 'Dwayne Johnson / Zac Efron / Priyanka Chopra / Alexandra Daddario / Kelly Rohrbach / Ilfenesh Hadera / Jon Bass / Yahya Abdul-Mateen II / Hannibal Buress / Rob Huebel / Amin Joseph / Jack Kesy / Oscar Nuez / David Hasselhoff / Pamela Anderson / Clem Cheun', 'http://legionofleia.com/wp-content/uploads/screen-shot-2017-04-19-at-9-32-34-am-copy.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi1469888793/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1469304', 5.8, 0, 37, 17, '#BAYWATCH,BAYWATCH', 0, 2),
(240, 'BERANGKAT', 'Jano (Tarra Budiman) adalah seorang mahasiswa Teknik Kimia yang menghabiskan waktu luangnya sebagai pekerja part-timer di toko music Aksara. Sejak kecil Jano sering kali menghadapi kendala dalam bersosialisasi, itulah sebabnya hingga usianya beranjak 22 tahun Jano masih sering di bully, namun Jano selalu memiliki Joana (Ayushita Nugraha) dan Dika (Ringgo Agus Rahman) yang selalu mendampingi Jano dikala Jano merasa kecil.\r\n\r\nJano jatuh cinta kepada salah seorang pelanggan toko musik tempatnya bekerja bernama Kayla (Annisa Pagih). Suatu hari Kayla datang ke Aksara dan meminta bantuan Jano untuk memasang poster konser musik di Bali miliknya tersebut dan sebagai gantinya Kayla memberikan 3 tiket konser musik itu kepada Jano. \r\n\r\nDika yang tengah sibuk membantu Joana menyelesaikan penelitian geologinya memaksa Jano untuk turut serta membantu Joana, akan tetapi Jano selalu menolak ajakan Dika. Dengan adanya tiket konser dari Kayla tersebut, Jano akhirnya memutuskan untuk turut membantu Dika dan Joana mengingat setelah selesai mengumpulkan data penelitian Joana di Kawah Ijen, mereka dapat melanjutkan perjalan mereka sampai Bali.\r\n\r\nBerbekal uang yang seadanya, mereka menyewa mobil VW Combi tua dari Gimbal (Tanta Ginting) yang mengantar mereka dari Jakarta, Malang sampai Bali. Masalah muncul silih berganti, berawal dari mobil yang sering rusak dijalan hingga kejadian-kejadian berbahaya yang mengancam nyawa mereka. Akankah mereka sampai di Bali dengan selamat?', 'Drama, Komedi, dan Adventure', 2017, '2017-10-09', 120, 'Naya Anindita', 'Isman', 'Tarra Budiman, Ayushita Nugraha, Ringgo Agus Rahman, Tanta Ginting, Anissa Pagih, Saykoji, Babe Cabita, Reza Nangin dan Martin Anugrah', 'http://media.21cineplex.com/webcontent/gallery/pictures/149922898511935_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/N2DJkvyozTg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2023394', 0, 0, 0, 0, '', 0, 1),
