(250, 'MARS MET VENUS (PART CEWE)', 'Pembahasan mengenai hubungan laki  laki dan perempuan tidak akan ada habisnya. Ada banyak sekali perbedaan baik dari segi fisik, sikap, dan perilaku tapi dibalik perbedaan tersebut justru mereka saling membutuhkan. Dan karena perbedaan, sebuah hubungan menjadi selalu berwarna dan menarik untuk selalu dibahas.\r\n\r\nWarna  warni sebuah hubungan dihadirkan MNC Pictures dalam film terbarunya Mars Met Venus (Part Cewe) karya Nataya Bagya. Film ini menceritakan KELVIN (Ge Pamungkas) adalah seorang calon arsitek yang berencana menikahi pacarnya, MILA (Pamela Bowie) adik kelasnya waktu SMA. Hubungan mereka layaknya pasangan lain yang dimulai dari cinta monyet, pedekate, jadian hingga ke jenjang yang lebih serius yaitu pernikahan.\r\n\r\nDalam rangka melamar Mila, Kelvin punya ide cemerlang untuk merekam perjalanan cinta mereka dengan membuat vlog dibantu LUKMAN (27th). Ternyata pembuatan vlog membuka hal-hal yang selama ini tidak diperhatikan Kelvin dan Mila. Banyak salah paham, dan sudut pandang yang bertentangan.\r\n\r\nKita semua tidak pernah tau seideal apa pasangan kita. Di Film Mars Met Venus (Part Cewe) ini, Porsi Cewe memang selalu mendominasi untuk sebuah hubungan, Dua sahabat Mila yang selalu ada: Icha (Ria Ricis) dan Malia (Rani Ramadhany) yang selalu support dan memberikan nasihat untuk hubungan Mila dan Kelvin. Part Cowo ada di film MARS, Kelvin dan Sahabatnya Reza, Bobby, Martin dan Steve (Cameo Project), akan release belakangan!', 'Drama, Comedy', 2017, '2017-07-24', 98, 'Hadrah Daeng Ratu', 'Nataya Bagya', 'Ge Pamungkas, Pamela Bowie, Reza Nangin, Ibob Tarigan', 'http://media.21cineplex.com/webcontent/gallery/pictures/149725174992026_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/qTD5xl6F6x4\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 39, 3, '#MARSMETVENUS(PARTCEWE),MARS MET VENUS (PART CEWE),MARS MET VENUS,MARS MET VENUS CEWE,#MARSMETVENUS,MARS MET VENUS', 0, 2),
(267, 'THE HUNTER&#039;S PRAYER', 'Martin, seorang tentara bayaran, yang dikirim dari Eropa oleh misterius biotech perusahaan untuk Tasmanian wilderness pada berburu untuk terakhir harimau Tasmania.', 'Adventure / Drama / Thriller', 2012, '2011-10-06', 102, 'Daniel Nettheim', 'Alice Addison / Wain Fimeri', 'Willem Dafoe / Frances O\'Connor / Sam Neill / Morgana Davies / Finn Woodlock / Jacek Koman / Callan Mulvey / John Brumpton / Dan Wyllie / Sullivan Stapleton / Jamie Timony / Dan Spielman / Maia Thomas / Marc Watson-Paul', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTI4Mzc0MTg4OV5BMl5BanBnXkFtZTcwNTc1NDQzNw@@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi3822756121/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', NULL, 6.8, NULL, 0, 0, '#THEHUNTER&#039;SPRAYER,THE HUNTER&#039;S PRAYER', 0, 1),
(271, 'THE DARK TOWER', 'Terakhir Gunslinger, Roland Deschain, telah terkunci dalam pertempuran yang abadi dengan Walter O\'Dim, juga dikenal sebagai Pria kulit Hitam, bertekad untuk mencegah dia dari menjatuhkan Menara Gelap, yang memegang alam semesta bersama-sama. Dengan nasib dunia dipertaruhkan, yang baik dan yang jahat akan bertabrakan dalam pertempuran utama karena hanya Roland dapat mempertahankan Menara dari Pria Hitam', 'Action / Adventure / Fantasy / Horror / Sci-Fi / Western', 2017, '2017-08-04', 95, 'Nikolaj Arcel', 'Akiva Goldsman / Jeff Pinkner', 'Katheryn Winnick / Matthew McConaughey / Idris Elba / Jackie Earle Haley / Abbey Lee / Dennis Haysbert / Alex McGregor / Nicholas Hamilton / Claudia Kim / Fran Kranz / Jos Ziga / Tom Taylor / Michael Barbieri / Victoria Nowak / Ben Gavin / Karl Thaning ', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTU3MjUwMzQ3MF5BMl5BanBnXkFtZTgwMjcwNjkxMjI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi1690417433/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', NULL, 0, NULL, 0, 0, '#THEDARKTOWER,THE DARK TOWER', 0, 1),
