(288, 'DETROIT', 'Di tengah-tengah kekacauan dari Detroit Pemberontakan, dengan kota di bawah jam malam dan Michigan Nasional Penjaga berpatroli di jalan-jalan, tiga anak muda Afrika Amerika laki-laki dibunuh di Aljazair Motel.', 'Crime / Drama / History / Thriller', 2017, '2017-08-04', 143, 'Kathryn Bigelow', 'Mark Boal', 'John Boyega / Will Poulter / Algee Smith / Jacob Latimore / Jason Mitchell / Hannah Murray / Jack Reynor / Kaitlyn Dever / Ben O\'Toole / John Krasinski / Anthony Mackie / Nathan Davis Jr. / Peyton \'Alex\' Smith / Malcolm David Kelley / Joseph David-Jones / ', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTg4MDk4MTUxMF5BMl5BanBnXkFtZTgwNDE5NjA5MjI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi540457241/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', NULL, 7.7, 80, 0, 0, '#DETROIT,DETROIT', 0, 1),
