(307, 'MARS MET VENUS (PART COWO)', 'Sisi laki-laki film Mars Met Venus, yang merupakan lanjutan dan jawaban dari banyaknya pertanyaan yang ada di part Cewe, Mila (Pamela Bowie) dan dua sahabat Mila yang selalu ada: Icha (Ria Ricis) dan Malia (Rani Ramadhany).\r\n\r\nMars Met Venus (Part Cowo), Porsi Cowo yang sebenarnya! Dari Kelvin (Ge Pamungkas) dan Sahabatnya Reza, Bobby, Martin dan Steve (Cameo Project) yang selalu support dan memberikan nasihat terhadap curhatan Kelvin tentang hubungannya dengan Mila. Hubungan percintaan yang tidak melulu merah jambu dan pada prosesnya selalu diwarnai oleh pertengkaran yang lucu.\r\n\r\nKeduanya kemudian sadar bahwa pertengkaran yang terjadi akibat rasa takut, takut kehilangan, takut menyakiti, bahkan takut mengatakan yang sebenarnya karena terlalu menyayangi satu sama lain.\r\n\r\nFilm yang dihadirkan MNC Pictures, disutradarai Hadrah Daeng Ratu dan ditulis oleh Nataya Bagya ini mengajarkan bahwa sampai kapanpun lelaki adalah lelaki dan perempuan pada dasarnya berbeda namun saling membutuhkan.', 'Drama, Comedy', 2017, '2017-08-03', 120, 'Hadrah Daeng Ratu', 'Nataya Bagya', 'Ge Pamungkas, Pamela Bowie, Reza Nangin, Ibob Tarigan', 'http://media.21cineplex.com/webcontent/gallery/pictures/149725582360856_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/waleQKSWCQM\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#MARSMETVENUS(PARTCOWO),MARS MET VENUS (PART COWO)', 0, 1),
(310, 'WIND RIVER', 'Pada tahun 1995 di Sarajevo, 5 tentara angkatan laut Amerika memiliki misi menemukan harta karun peninggalan perang dunia II yang terletak di danau Bosnia.\r\n \r\nHal tersebut dilakukan dalam upaya membantu penduduk setempat dan nantinya akan dikembalikan kepemiliknya yang sah. Namun, dalam sebuah peristiwa, misi tersebut diketahui oleh pihak musuh.', 'Action / Crime / Mystery / Thriller', 2017, '2017-08-04', 107, 'Taylor Sheridan', 'Richard Wenk, Luc Besson', 'Kelsey Asbille / Jeremy Renner / Julia Jones / Teo Briones / Apesanahkwat / Graham Greene / Elizabeth Olsen / Tantoo Cardinal / Eric Lange / Gil Birmingham / Althea Sam / Tokala Clifford / Martin Sensmeier / Tyler Laracca / Shayne J. Cullen / Dallin Tusies', 'http://www.joblo.com/posters/images/full/wind-river-poster-new.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi3821713689/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4106376', 7.5, 72, 0, 0, '#WINDRIVER,WIND RIVER', 0, 0),
