(318, 'MY LITTLE PONY THE MOVIE', 'Ketika sebuah kekuatan gelap yang benarkah demokrasi mulai dikebiri Ponyville dan Surai 6, mereka pergi pada perjalanan untuk akhir Equestria untuk menyelamatkan mereka cintai di rumah dan mereka bertemu teman-teman baru dan berbahaya tantangan di sepanjang jalan.', 'Animation / Adventure / Comedy / Family / Fantasy / Musical', 2017, '2017-10-06', 99, 'Jayson Thiessen', 'Meghan McCarthy / Rita Hsiao', 'Emily Blunt / Kristin Chenoweth / Liev Schreiber / Michael Pea / Sia / Taye Diggs / Uzo Aduba / Zoe Saldana / Tara Strong / Britt McKillip / Ashleigh Ball / Shannon Chan-Kent / Nicole Oliver / Andrea Libman / Tabitha St. Germain / Sam Vincent / Michael Do', 'https://cdn.traileraddict.com/content/lionsgate/my-little-pony-poster.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi3637885209/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#MYLITTLEPONYTHEMOVIE,MY LITTLE PONY THE MOVIE', 0, 0),
(319, 'PETAK UMPET MINAKO', 'Sekelompok anak muda melakukan HItori Kakurenbo ritual.', 'Horror', 2017, '2017-09-07', 0, 'Billy Christian', 'Billy Christian', 'Regina Rengganis / Gandhi Fernando / Miller Khan / Natasha Gott / Nicky Tirta', 'https://images-na.ssl-images-amazon.com/images/M/MV5BZmFjYmY3ZmYtYjQ1Ni00ZjM4LTlkOTQtMzVlYmI1ODAyZTBjXkEyXkFqcGdeQXVyMzMzNjk0NTc@.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/Q6f7EVXP2Mc\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#PETAKUMPETMINAKO,PETAK UMPET MINAKO', 0, 1),
(320, 'JEMBATAN PENSIL', 'Perjuangan anak-anak usia Sekolah Dasar (Inal, Nia, Aska, Yanti dan Ondeng) untuk terus mendapatkan pendidikan di sebuah Sekolah Gratis yang dibangun oleh Pak Guru. Inal yang tuna netra dan Ondeng yang memiliki keterbelakangan, tetap bisa menikmati masa-masa sekolah dengan gembira walaupun harus melalui perjalanan berliku untuk berangkat dan pulang sekolah. \r\n\r\nKemampuan Ondeng menggambar sketsa menjadi kesibukan hari-harinya di dalam maupun di luar sekolah, dia selalu merekam semua yang menjadi ketertarikannya dalam gambar sketsa, termasuk kehidupan ayahnya yang seorang nelayan dan jembatan rapuh yang selalu dilalui sahabat-sahabatnya. Cita-citanya adalah untuk membangun jembatan yang setiap hari dilalui sahabat-sahabatnya itu. Ketika akhirnya jembatan rapuh itu rubuh saat keempat sahabat itu sedang menyeberang, tidak membuat semangat anak-anak itu pupus. \r\n\r\nKetakutan dan pikiran Ondeng yang selalu teringat ayahnya dan ketakutannya setelah ditinggal ayahnya membuat Ondeng lepas kendali dan tidak menyadari bahayanya membawa perahu sendiri ke laut. \r\n\r\nBagaimana akhirnya impian Ondeng untuk membangun jembatan untuk teman-temannya?', 'Drama', 2017, '2017-10-07', 107, 'Hasto Broto', 'Exan Zen', ' Permata Jingga / Kevin Julio / Meriam Bellina  ', 'https://upload.wikimedia.org/wikipedia/id/f/fa/Jembatan_Pensil.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/bF0NTHasDgI\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#JEMBATANPENSIL,JEMBATAN PENSIL', 0, 1),
(323, 'GERBANG NERAKA', 'Dalam piramida tertua di dunia ditemukan di Indonesia. Seorang jurnalis harus bekerjasama dengan seorang arkeolog...', 'Adventure / Fantasy / Horror / Mystery / Thriller', 2016, '2017-09-20', 113, 'Rizal Mantovani', 'Robert Ronny', 'Julie Estelle / Ray Sahetapy / Reza Rahadian / Dwi Sasono', 'https://images-na.ssl-images-amazon.com/images/M/MV5BYzY2MzgwNjUtYTRmOS00NDE2LWFlY2UtNmJkNTgwZWNjNWVhXkEyXkFqcGdeQXVyMTE4OTcyMA@@.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/48D_UYJmmzo\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#GERBANGNERAKA,GERBANG NERAKA', 0, 1),
(324, 'THE HITMAN\'S BODYGUARD', 'Dua pembunuh bayaran, salah satu pemula dan veteran dengan buruk keberuntungan, band bersama-sama untuk menemukan \"Raja Pembunuh\" bagi siapa yang dikehendaki-nya pahala yang besar.', 'Action / Comedy / Crime / Thriller', 2017, '2017-08-31', 117, 'Wei Tung', 'Hing-Ka Chan / Kam Fu Cheng', 'Jet Li / Eric Tsang / Simon Yam / Gigi Leung / Timmy Ho / Kwong Kim Yip / John Ching / Keiji Sato / Hideri Meiken / Kenji Sahara / Paul Rapovski / Frankie Chi-Hung Ng / Ta Lei / Jude Poyer / Shing-Hung Leung / Kwai-Bo Chun / Sam Kai-Sen Huang / Dion Lam / ', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk2Njk4OTQzNV5BMl5BanBnXkFtZTcwNDI5ODYxMQ@@.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/uPRed1WMEug\" frameborder=\"0\" allowfullscreen></iframe>', '', 6.2, 0, 0, 0, '#THEHITMAN\'SBODYGUARD,THE HITMAN\'S BODYGUARD', 0, 1),
(327, 'IT', 'Sekelompok anak-anak diganggu dengan masalah kehidupan keluarga, band bersama-sama ketika sebuah rakasa, dengan penampilan badut, mulai berburu anak-anak.', 'Drama / Horror', 2017, '2017-09-08', 135, 'Andy Muschietti', 'Chase Palmer / Cary Fukunaga', 'Bill Skarsgrd / Finn Wolfhard / Sophia Lillis / Javier Botet / Nicholas Hamilton / Jaeden Lieberher / Owen Teague / Megan Charpentier / Wyatt Oleff / Jack Dylan Grazer / Steven Williams / Jeremy Ray Taylor / Tatum Lee / Jackson Robert Scott / Chosen Jacob', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOTE0NWEyNDYtYWI5MC00MWY0LTg1NDctZjAwMjkyMWJiNzk1XkEyXkFqcGdeQXVyNjk5NDA3OTk@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi1396095257/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#IT,IT', 0, 1),
(328, 'PENGABDI SETAN', 'Setelah sakit aneh selama 3 tahun, Ibu akhirnya meninggal dunia. Bapak lalu memutuskan untuk kerja di luar kota meninggalkan anak-anak. Tak lama kemudian, anak-anak merasa bahwa Ibu kembali berada di rumah. Situasi semakin menyeramkan ketika mereka mengetahui bahwa Ibu datang lagi tidak sekedar untuk menjenguk, tapi untuk menjemput mereka.', 'Horror', 2017, '2017-09-28', 109, 'Joko Anwar', 'Sisworo Gautama Putra / Joko Anwar', 'Bront Palarae / Tara Basro / Dimas Aditya / Endy Arfian / Ayu Laksmi / Egy Fedly / M. Adhiyat / Asmara Abigail / Fachry Albar / Nasar Annuz', 'https://images-na.ssl-images-amazon.com/images/M/MV5BYjU5NjYyNzQtZDQ3Ny00Y2FkLWIyZGYtNzM5YzM3NDdjMjUxXkEyXkFqcGdeQXVyMzYzOTYxNzM@.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/5GkD7hrsY_g\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#PENGABDISETAN,PENGABDI SETAN', 0, 0),
(329, 'AN INCONVENIENT SEQUEL : TRUTH TO POWER', 'Satu dekade setelah An Inconvenient Truth (2006) membawa perubahan iklim ke jantung budaya populer datang follow-up yang menunjukkan seberapa dekat kita ke real revolusi energi.', 'Documentary', 2017, '2017-08-04', 98, 'Bonni Cohen / Jon Shenk', 'n/A', 'Al Gore / Hilary Ashford-Ng / George W. Bush / John Kerry / Marco Krapels / Angela Merkel / Barack Obama / Vladimir Putin / Donald J. Trump / Tom Rielly', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTkzNTQ0MzA3Ml5BMl5BanBnXkFtZTgwNzg4OTcyMjI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi1430763033/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', '', 5.2, 0, 0, 0, '#ANINCONVENIENTSEQUEL:TRUTHTOPOWER,AN INCONVENIENT SEQUEL : TRUTH TO POWER', 0, 1),
(330, 'THE FOREIGNER', 'Rendah hati pengusaha dengan mengubur masa lalu yang mencari keadilan ketika putrinya yang tewas dalam aksi terorisme. Kucing-dan-tikus konflik yang terjadi dengan seorang pejabat pemerintah, yang lalu dapat memegang petunjuk untuk para pembunuh\' identitas.', 'Action / Thriller', 2017, '2017-10-13', 114, 'Martin Campbell', 'David Marconi', 'Jackie Chan / Pierce Brosnan / Michael McElhatton / Charlie Murphy / Katie Leung / Orla Brady / Simon Kunz / Ray Fearon / Rory Fleck Byrne / Pippa Bennett-Warner / Dermot Crowley / David Pearse / Dilyana Bouklieva / Roberta Taylor / Rufus Jones / Stephen H', 'https://images-na.ssl-images-amazon.com/images/M/MV5BM2RlMjcyMGQtZTU3OC00NGRlLWExMGEtYjU3ZjUyMDc0NWZmXkEyXkFqcGdeQXVyNTI4MzE4MDU@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi3973167385/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#THEFOREIGNER,THE FOREIGNER', 0, 0),
(340, 'BABY DRIVER', 'Setelah dipaksa bekerja untuk bos kejahatan, muda getaway driver menemukan dirinya mengambil bagian dalam perampokan ini, ditakdirkan untuk gagal.', 'Action / Crime / Music / Thriller', 2017, '2017-06-28', 112, 'Edgar Wright', 'Edgar Wright', 'Ansel Elgort / Jon Bernthal / Jon Hamm / Eiza Gonzlez / Micah Howard / Lily James / Morgan Brown / Kevin Spacey / Morse Diggs / CJ Jones / Sky Ferreira / Lance Palmer / Hudson Meek / Viviana Chavez / Hal Whiteside / Flea / Lanny Joon / Jamie Foxx / Clay D', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjM3MjQ1MzkxNl5BMl5BanBnXkFtZTgwODk1ODgyMjI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi2482288921/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', '', 8.2, 0, 0, 0, '#BABYDRIVER,BABY DRIVER', 0, 1),
(356, 'KINGSMAN: THE GOLDEN CIRCLE', 'Ketika markas mereka yang hancur dan dunia disandera, Kingsman perjalanan membawa mereka ke penemuan sekutu organisasi mata-mata di AS. Dua elit rahasia organisasi harus bersatu untuk mengalahkan musuh yang sama.', 'Action / Adventure / Comedy', 2017, '2017-09-22', 0, 'Matthew Vaughn', 'Jane Goldman / Matthew Vaughn', 'Taron Egerton / Channing Tatum / Pedro Pascal / Sophie Cookson / Halle Berry / Mark Strong / Jeff Bridges / Julianne Moore / Colin Firth / Poppy Delevingne / Hanna Alstrm / Vinnie Jones / Edward Holcroft / Samantha Womack / Elton John / Lena Endre / Alexa', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTBlOWZhZTctOTY0MC00Y2QyLTljMmYtZDkxZDFlMWU4Y2EyXkEyXkFqcGdeQXVyNDg2MjUxNjM@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi734968089/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4649466', 0, 0, 0, 0, '#KINGSMAN:THEGOLDENCIRCLE,KINGSMAN: THE GOLDEN CIRCLE', 0, 1),
