(369, 'DOG EAT DOG', 'Awak ex-kontra yang disewa oleh Cleveland mafioso untuk menculik bayi dari seorang mafia saingan.', 'Crime / Drama / Thriller', 2016, '2016-11-18', 93, 'Paul Schrader', 'Edward Bunker / Matthew Wilder', 'Nicolas Cage / Willem Dafoe / Christopher Matthew Cook / Omar J. Dorsey / Louisa Krause / Melissa Bolona / Reynaldo Gallegos / Chelcie Lynn / Bruce Reizen / Jeff Hilliard / Ali Wasdovich / Louis Perez / Magi Avila / Tevis R. Marcum / Todd Emmett / Michael ', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTc0ODExNjM4NV5BMl5BanBnXkFtZTgwNzY4ODYxMDI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi782087705/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4054654', 4.6, 53, 0, 0, '#DOGEATDOG,DOG EAT DOG', 0, 0),
(370, 'SUAMI UNTUK MAK', 'Film ini akan menceritakan tentang seorang wanita bernama Sarah, Dirinya adalah seorang Ibu yang memiliki lima orang anak dari suami yang berbeda-beda, mereka yaitu Adul, Gilbert, Koko, Bontot dan Billy. Bapak - bapak mereka berlima telah meninggal, Namun masing-masing dari mereka mewarisi gen bapak dengan kuat, sehingga menjadikam kelima bersaudara tersebut mempunyai fisik dan juga sifat yang berbeda-beda pula, yang sesuai dengan latar belakang dari bapak mereka, yaitu ada Betawi, Jawa, Ambon, Cina dan juga agama yang berbeda-beda pula.\r\n\r\nTak berapa lama lagi Sarah Akan berulang tahun, dan lima bersaudara tersebut berlomba ingin memberikan sebuah kado yang istimewa untuk Mak mereka (panggilan mereka pada Sarah), Dan setelah melalui sebuah diskusi dan juga perdebatan yang sangat seru, tercetuslah sebuah kado yang sangat istimewa untuk Sarah, yaitu Suami Untuk Mak. Seperti apakah keseruan kisahnya? Temukan jawabannya dengan menonton Full Movie nya dibioskop kesayangan anda, mulai tanggal 5 September 2017.', 'Drama, Comedy', 2017, '2017-09-20', 0, 'Yosua Rocky', 'Vera Zanobia, Ikhsan, CMI Team', 'Dodit Mulyanto, Rano Karno, Lidya Kandou', 'http://media.21cineplex.com/webcontent/gallery/pictures/15041526078906_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/k9bJwopnnvA\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#SUAMIUNTUKMAK,SUAMI UNTUK MAK', 0, 0);
