(375, 'MY STUPID BOYFRIEND', 'Di ceritakan Lovers Club adalah merupakan sebuah komunitas yang dibentukuntuk tujuan membantu orang-orang yang mengalami tentang masalah didalam percintaan. Dan dengan bergabung menjadi anggota club seta membayar sejumlah uang pendaftaran, Jamal beserta anggota yang lain siap beraksi untuk membelanya.\r\n\r\nJamal Oedin Sastrowardoyo memiliki jabatan sebagai presiden club, Titira Jobita sebagai seorsng wakil presiden club, Arie L Tumming sebagai kepala administrasi dan sedangkan Abu Rellie Hermansyah sebagai kepala keuangan. Di basecamp Lovers club semua pergerakan dan juga strategi disiapkan. Samara adalah merupakan gadis yang dicintai oleh Jamal, walaupun Jamal tahu bahwa Samara memiliki pacar bernama Ruben.\r\n\r\nSedangkan disisi lain orang tua dari Samara ingin menjodohkannya dengan seorang penyanyi dangdut keliling yaitu bernama Hercules. Dengan menjanjikan janji-janji manis Hercules meminta tolong ke Zeus (nama ayah Samara) untuk melamarkan samara. akan tetapi Samara tetap memilih Ruben.\r\n\r\nKeinginan dari Ruben untuk menikah dengan Samara, terdengar oleh bos mafia yang merupakan musuh bisnis dari papanya, yaitu bernama  Don Carlo. Hal itu dimanfaatkan oleh Carlo untuk menculik Ruben dan juga Samara, yang akan Ia jadikan sebagai jaminan untuk meminta uang tebusan. Carlo meminta uang tebusan sebesar 10 milyar, untuk Ruben dan Samara kepada Cokro (ayah Ruben). Seperti apa kisah selengkapnya?', 'Comedy', 2017, '2017-09-28', 120, 'Joel Fadly', 'Jf Zola & Anash Olivia', 'Gary Iskak,Joe Project, Agung Hercules, Tumming', 'http://media.21cineplex.com/webcontent/gallery/pictures/150399035772680_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/wnJL2M5J5hc\" frameborder=\"0\" allowfullscreen></iframe>', '', 0, 0, 0, 0, '#MYSTUPIDBOYFRIEND,MY STUPID BOYFRIEND', 0, 0),
(377, 'THE EXCEPTION', 'Seorang tentara jerman yang mencoba untuk menentukan apakah perlawanan belanda telah ditanam mata-mata untuk menyusup rumah Kaiser Wilhelm di Belanda selama terjadinya Perang Dunia II, tapi jatuh untuk seorang muda Yahudi wanita belanda selama penyelidikan.', 'Drama / Romance / War', 2016, '2017-06-02', 107, 'David Leveaux', 'n/A', 'Los van Wijk / Jai Courtney / Karin Leclercq / Anton Lesser / Christopher Plummer / Aubeline Barbieux / Janet McTeer / Lily James / Stphane Auberghen / Ben Daniels / Martin Swabey / Martin Savage / Mark Dexter / Kurt Standaert / Kris Cuppens / Frederik L', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk4ODcyOTI3NV5BMl5BanBnXkFtZTgwMjgyOTUxMjI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi1118157081/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4721124', 6.8, 60, 0, 0, '#THEEXCEPTION,THE EXCEPTION', 0, 1),
