(383, 'THE LEGO NINJAGO MOVIE', 'Enam anak ninja Lloyd, Jay, Kai, Cole, dan Zane Nya bertugas dengan membela pulau mereka pulang, yang disebut Ninjago...', 'Animation / Action / Adventure / Comedy / Family', 2017, '2017-09-22', 0, 'Charlie Bean / Paul Fisher', 'Bob Logan / Paul Fisher', 'Olivia Munn / Justin Theroux / Jackie Chan / Dave Franco / Kumail Nanjiani / Abbi Jacobson / Michael Pea / Zach Woods / Fred Armisen / Kaan Guldur', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTYxNjIxNzM5Nl5BMl5BanBnXkFtZTgwMzg5NzY2MjI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi690796825/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3014284', 0, 0, 0, 0, '#THELEGONINJAGOMOVIE,THE LEGO NINJAGO MOVIE', 0, 0),
