(392, 'THE ZOOKEEPER\'S WIFE', 'Zookeeper Istri menceritakan kisah penjaga kebun Binatang Warsawa, Antonina dan Jan Zabinski, yang membantu menyelamatkan ratusan orang dan hewan selama invasi jerman.', 'Biography / Drama / History / War', 2017, '2017-04-07', 127, 'Niki Caro', 'Angela Workman / Diane Ackerman', 'Jessica Chastain / Johan Heldenbergh / Daniel Brhl / Timothy Radford / Efrat Dor / Iddo Goldberg / Shira Haas / Michael McElhatton / Val Maloku / Martha Issov / Daniel Ratimorsk / Frederick Preston / Theo Preston / Viktoria Zakharyanova / Goran Kostic /', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNTY3YmZmYmMtZjc3Zi00N2VjLWE5ZGMtN2M0ODkzOGQ5M2UyL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNTk1MTQ3NDI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi2949821977/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1730768', 7, 0, 0, 0, '#THEZOOKEEPER\'SWIFE,THE ZOOKEEPER\'S WIFE', 0, 0),
(393, 'BLADE RUNNER 2049', 'Muda blade runner penemuan yang lama bayi rahasia membawa dia pada quest untuk melacak mantan blade runner, Rick Deckard, yang telah hilang selama tiga puluh tahun.', 'Sci-Fi / Thriller', 2017, '2017-10-06', 163, 'Denis Villeneuve', 'Hampton Fancher / Michael Green', 'Ana de Armas / Robin Wright / Dave Bautista / Jared Leto / Ryan Gosling / Harrison Ford / Mackenzie Davis / Edward James Olmos / Sylvia Hoeks / Lennie James / Elarica Johnson / Barkhad Abdi / David Dastmalchian / Hiam Abbass / Carla Juri / Mark Arnold / Ki', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjM3NjcxNDM4Ml5BMl5BanBnXkFtZTgwMjI4NDIzMzI@.jpg', '<iframe width=\"894\" height=\"520\" src=\"http://www.imdb.com/video/imdb/vi3405953305/imdb/embed?autoplay=false&width=854\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1856101', 0, 0, 0, 0, '#BLADERUNNER2049,BLADE RUNNER 2049', 0, 0),
