(395, 'DUKA SEDALAM CINTA', 'Gagah mengalami kecelakaan dan dibantu oleh Yudi dan saudaranya, Kyai Ghufron. Setelah kembali dari Maluku Utara, Gagah berubah. Mama dan Gita adalah sulit untuk menerima perubahan.', 'Drama', 2017, '2017-10-19', 0, 'Firman Syah', 'Fredy Aryanto', 'Hamas Syahid / Aquino Umar / Masaji Wijayanto / Izzah Ajrina / Kholidi Asadil Alam / Abdurrahim Arsyad / Salim A. Fillah / Wulan Guritno / Epy Kusnandar / Asma Nadia', 'https://www.dakwatuna.com/wp-content/uploads/2016/10/poster-film-duka-sedalam-cinta.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/b52FqoPhiuU\" frameborder=\"0\" allowfullscreen></iframe>', 'tt7340660', 0, 0, 0, 0, '#DUKASEDALAMCINTA,DUKA SEDALAM CINTA', 0, 0),
(396, 'MOLULO', 'Menikah dengan pasangan gay, Henry dan Martin tinggal di Homolulu. Seperti semua istri mereka memiliki pendapat yang berbeda, dan mereka pasti memiliki lurus, pernikahan heteroseksual. Pintar memutar bermain di sterotypes dengan tidak begitu tersembunyi pesan politik.', 'Comedy / Short', 2004, '2004-10-07', 0, 'Frank Mosvold', 'n/A', 'Per Christian Ellefsen / Bjrn Sundquist', 'https://images-na.ssl-images-amazon.com/images/M/MV5BZmJjNjIwNzEtN2U5OC00ZWY5LTg5OWMtZmYxMTJhYThiN2RlXkEyXkFqcGdeQXVyMjI0Mjk2MDg@.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/OI37fno224s\" frameborder=\"0\" allowfullscreen></iframe>', 'tt0419818', 5.3, 0, 0, 0, '#MOLULO,MOLULO', 0, 0);
